INSERT INTO `berita` (`id`, `nama_berita`, `detail`, `gambar`, `created_at`, `updated_at`) VALUES
('96a1e450-557e-4fd4-9323-996340ce5e27', 'Sertifikasi Uji Kompetensi Bidang Informatika bagi Angkatan Kerja Muda Lulusan Teknik Informatika Politap, AMKI Ketapang dan SMK Bidang TIK.', 'Kementerian Komunikasi dan Informatika melalui Badan Penelitian dan Pengembangan SDM, Balai Besar Pengembangan SDM dan Penelitian Komunikasi dan Informatika (BBPSDMP Kominfo) Medan bekerjasama dengan Politeknik Negeri Ketapang Kabupaten Ketapang Provinsi Kalimantan Barat dan Lembaga Sertifikasi Profesi (LSP) TIK Jakarta, melaksanakan fasilitasi﻿ sertifikasi SKKNI bidang TIK bagi angkatan  kerja muda di Kabu﻿paten Ketapang. Fasilitasi Sertifikasi SKKNI tersebut diikuti oleh peserta yang berasal dari Kabupaten Ketapang dan sekitarnya. Skema yang diujikan yaitu  Junior Network Administrator, Junior Web Programming, Desain Grafis Junior, Junior Mobile Programming, dan Technical Support. Kegiatan yang dilaksanakan selama 5 hari ini dimulai pada tanggal 12 s.d. 16 November 2019 bertempat di Aula Rektorat Politeknik Negeri Ketapang. Berdasarkan laporan ketua panitia, Abdul Rahman Harahap, S.Sos, M.Si, kegiatan ini diikuti diikuti oleh 73 peserta yang merupakan lulusan SMK dan D3 bidang TIK. Dengan tujuan membantu angkatan kerja muda, khususnya lulusan sekolah menengah kejuruan dan D3 bidang TIK dalam memperoleh sertifikat keahlian. Pembukaan dilaksanakan pada Hari Selasa, tanggal 12 November 2019, yang dihadiri oleh Kepala BBPSDMP Kominfo Medan Drs. Irbar Samekto, M.Si, Kadis Kominfo Kabupaten Ketapang diwakili oleh Merli Andika, S.Kom, Direktur Politeknik Negeri Ketapang, Endang Kusmana, S.E., M.M., Ak., CA, Direktur LSP TIK Jakarta, Sofwan Hidayat, para instruktur dan assesor.', 'app/berita/1656220643-5975Z.jpg', '2022-08-10 01:59:07', '2022-08-09 18:59:07'),
('96a1f83e-fbf3-445e-82b0-4127b9dc40d2', 'Sosialisasi dan Pelatihan Pemanfaatan Teknologi Informasi sebagai Media Pembelajaran Blended Learning melalui Google Classroom di SMK Negeri 1 Ketapang', 'KETAPANG – Politeknik Negeri Ketapang melalui Program Studi DIII Teknik Informatika baru saja selesai melaksanakan Program Kemitraan Masyarakat bersama SMK Negeri 1 Ketapang yang mengangkat tema “Sosialisasi dan Pelatihan Pemanfaatan Teknologi Informasi sebagai Media Pembelajaran Blended Learning melalui Google Classroom di SMK Negeri 1 Ketapang”. Kegiatan yang dilaksanakan pada hari Kamis (5/12) kemarin diikuti dengan antusias oleh 35 guru-guru dari berbagai jurusan di SMK Negeri 1 Ketapang. Eka Wahyudi, S.Pd., M.Cs. sebagai Ketua Program Studi Teknik Informatika pada saat itu berkesempatan menyambut guru-guru dan membuka kegiatan dengan hangat. Pada sambutannya Eka menyampaikan, “Sebagai langkah kita yang saat ini memasuki Era Revolusi Industri 4.0, selayaknya memang kita perlu untuk berevolusi dalam proses belajar mengajar dengan memanfaatkan teknologi informasi di era yang serba digital ini agar pendidikan di Indonesia dapat lebih baik lagi kedepannya.”\r\n\r\nBlended Learning sebagai tema yang diangkat merupakan sebuah metode pembelajaran yang mengkombinasikan pembelajaran konvensional dan pembelajaran berbasis teknologi. Mengapa perlu dilakukan blended learning? Menurut Rizqia Lestika Atimi, M.T yang bertindak sebagai pemateri pada kegiatan tersebut menuturkan, “Blended learning memiliki keunggulan dari sisi fleksibilitas dalam pembelajaran dua arah karena tidak terbatas ruang dan waktu. Guru tetap dapat berdiskusi dan memberikan feedback secara real time dengan muridnya tidak hanya pada saat jam pelajaran, tetapi bisa dilakukan di luar jam pelajaran. Selain itu, proses pemberian tugas, pelaksanaan kuis, serta pendistribusian materi ajar dapat dilakukan secara lebih mudah dan terkontrol. Tetap ada proses pengawasan dan evaluasi terhadap murid yang dapat guru lakukan melalui pembelajaran blended learning ini dan Google Classroom adalah salah satu LMS (learning management system) yang saat ini dapat dimanfaatkan secara gratis.”', 'app/berita/1656223987-7p7BH.jpg', '2022-08-10 01:59:39', '2022-08-09 18:59:39');
