INSERT INTO `lulusan` (`id`, `label`, `isi`, `created_at`, `updated_at`) VALUES
('96b695db-7d7d-4c42-a163-f8ff3f17f26c', 'Junior Programmer', '<p class=\"MsoNormal\" style=\"text-align: justify; \">&nbsp;Lulusan Ahli Madya Komputer mampu mengkonversikan spesifikasi\r\ndan problem statement beserta prosedur suatu proyek menjadi logical flow yang\r\ndetil sehingga siap dicoding dalam bahasa pemrograman</p>', '2022-07-06 12:22:51', '2022-07-06 05:22:51'),
('96b6960a-c8c5-4a4b-8c62-734b0d73adec', 'System Analyst', '<p class=\"MsoNormal\" style=\"text-align:justify\">Lulusan ahli madya komputer mampu\r\nmenganalisis kebutuhan secara kritis, merancang, mengkoordinasikan,\r\nmerekomendasikan dan melakukan evaluasi terhadap perangkat lunak atau sistem\r\nyang sesuai dengan kebutuhan organisasi bisnis atau perusahaan</p>', '2022-07-06 12:23:40', '2022-07-06 05:23:40'),
('96b69635-d3f4-4638-9f12-16abce004f5e', 'Network Administrator', '<p class=\"MsoNormal\">Lulusan mampu melakukan perancangan arsitektur dan pembangunan\r\njaringan selain itu dapat memelihara teknologi jaringan, dan dapat mengelola\r\ninternet di lingkungan industri, pemerintahan, perbankkan dan pada\r\nbidang-bidang pekerjaan lainnya</p>', '2022-07-06 12:24:28', '2022-07-06 05:24:28'),
('96b69658-6559-434a-90c9-f10900c38330', 'Technopreneur', '<p class=\"MsoNormal\">Lulusan Ahli Madya Komputer mampu berinovasi dan memiliki\r\nketerampilan Technopreneur dalam menghasilkan jasa dan produk di bidang Teknik Informatika.</p>', '2022-07-06 12:25:20', '2022-07-06 05:25:20');
INSERT INTO `mata_kuliah` (`id`, `kode`, `nama`, `semester`, `kurikulum`, `sks`, `jenis_mk`, `jam_teori`, `jam_praktikum`, `tiu`, `bahasan`, `referensi`, `created_at`, `updated_at`) VALUES
('96ada2d7-23c8-46a0-be27-08083961cf63', 'TIK1205', 'Bahasa Inggris 1', 1, 2015, 2, 1, 2, 0, 'Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Mengidentifikasi bentuk tunggal dan jamak dari kata benda,\r\nMengidentifikasi struktur, tujuan dan karakteristik dari teks deskriptif , Mengidentifikasi kata sifat, Mendeskripsikan benda (elemen\r\ndasar computer) dengan benar (menulis teks deskripsi), Mengidentifikasi struktur, tujuan, dan karakteristik teks prosedur,\r\nMenjelaskan cara mengoperasikan benda (menulis teks prosedur).', 'Singular and plural form of noun (computer elements), Identifying the generic structure, objective, and language features of\r\ndescriptive text, present tense, Adjective phrase, Writing a descriptive text, Identifying the generic structure, objective, and language\r\nfeatures of procedure text, The use of connectives dan Writing procedure text', '<ol><li> Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents.</li><li>Englishindo. 2015. Descriptive Text: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2015/07/contoh-descriptivetext.html), accessed on February 18th, 2016)</li><li>Englishindo. 2014. ProcedureText: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2014/04/procedure-text.html),\r\naccessed on February 18th, 2016.</li><li>Esteras, Santiago Remacha. 2007. Professional English in Use: for Computer and Internet. Cambridge: Cambridge University\r\nPress</li><li>Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University\r\nPress</li><li>Walker, Tricia. 1989. English for Academic Purposes Series Computer science. England: Cassel</li></ol>', '2022-07-01 18:24:15', '2022-07-01 18:24:15'),
('96ada321-d429-4a1f-b504-018960ba02f2', 'TIK1208', 'Matematika Teknik 1', 1, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:Memiliki pengetahuan dan kemampuan menerapkan pengetahuan\r\nmatematika dalam memahami dan memecahkan masalah yang berhubungan dengan bidang teknik.<br></p>', '<p><b>Sistem Bilangan Riil dan Bilangan Kompleks</b>: Pertidaksamaan dan harga mutlak.</p><p><b>Fungsi Satu Peubah</b>: Definisi dan Jenis, Grafik (kartesian, polar, parameter); </p><p><b>Operasi pada Fungsi</b>; Definisi dan Teorema Limit;\r\nKekontinuan; Definisi; Rumus-Rumus Dasar.\r\n</p><p><b>Turunan:</b> Teknik Turunan, Aturan rantaii, Turunan Implisit. Aplikasi turunan; grafik fungsi(polinomial dan pecahan rasional)\r\n</p><p><b>Integral tak tentu dan tentu</b>: Teorema dasar kalkulus; Sifat dasar integral; Teknik integrasi.&nbsp;<br></p>', '<p>Anton, Howard, (1990), Elementry Linier Algebra, John Wiley International Edition.\r\n</p><p>Donovan, George, (1980), Trigonometry With Calculus, Prindle Weber &amp; Schmidt.\r\n</p><p>K.A. Stroud, (1998), Matematika Untuk Teknik, Ganeca, Bandung.\r\n</p><p>Matrik, F.Ayres, Erlangga, Latest Edition.\r\n</p><p>Purcell, Edwin, (1990), Kalkulus dan Geometrik Analitik Jilid 1, Erlangga.\r\n</p><p>Purcell, Edwin, (1990), Kalkulus dan Geometrik Analitik Jilid 2, Erlangga.\r\n</p><p>Purcell, Edwin, (2000), Kalkulus dan Geometri Analitik, Ganeca, Bandung<br></p>', '2022-07-01 18:25:04', '2022-07-01 18:25:04'),
('96ada32d-a72c-4571-be6b-b1709ef1fcd7', 'TIK1211', 'Pengantar Teknologi Informasi', 1, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Agar mahasiswa mengetahui perkembangan terkini dari Teknologi Informasi serta kaitannya dengan bidang-bidang lain.&nbsp;<br></p>', '<p>Mata kuliah ini akan memberikan pengetahuan dasar bagi mahasiswa tentang perkembangan teknologi informasi yang meliputi : teknologi computer, teknologi telekomunikasi, dan jaringan komputer.</p><ol><li>Memahami konsep dasar Sistem Informasi dan Teknologi Informasi</li><li>Memahami sistem Komputer dan fungsinya</li><li>Memahami sistem Telekomunikasi</li><li>Memahami sistem Jaringan</li><li>Memahami konsep SIM dan macam-macamnya</li><li>Mengetahui beberapa bidang aplikasi dari IT</li></ol>', '<ol><li>Martin, Hoffer, DeHayes, Perkins. Managing Information Technology, 1994 2.</li><li>Putranta, HD. Pengantar Sistem dan Teknologi Informasi, 2004</li><li>Daniels N.C, Information Technology, 1994</li><li>Poppel, Goldstein, Information Technology, 1996</li></ol>', '2022-07-01 18:25:11', '2022-07-01 18:25:11'),
('96ada336-4017-4220-9a46-c50d10f5c910', 'TIK1333', 'Konsep Basis Data', 1, 2015, 3, 3, 2, 4, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa mampu memodelkan data dan informasi dalam bentuk diagram konsep dan diagram\r\nfisik serta menerapkannya ke dalam basis data. Mampu membuat aplikasi basis data untuk memanipulasi data dalam basis data<br></p>', '<p><b>Teori :\r\n</b></p><p>Pengantar Basisdata, Model Data, Model ER, Model Relational, SQL dan Basis Relational, Desain Basisdata Relational, Keamanan\r\ndan Integritas Basisdata, Arsitektur Sistem Basisdata, Transaksi, Konkruensi dalam Basisdata, Sistem Pemulihan dari Kerusakan.\r\n</p><p><b>Praktikum :\r\n</b></p><p>Malakukan Rekayasa Sistem Basis Data Sesuai Materi Teori Konsep Basis Data<br></p>', '<ol><li>Silberschatz, Korth, Sudarshan, Database System Concept, Foxit Software Company, 2014</li><li>Celko Joe, SQL Programming Stule, Elsevier, 2015.</li><li>Rivero, Laura C, Encyclopedia of Database Technologies and Application, IDEA Group, 2005.</li><li>Akins Marcia, 1001 Things You Know About Visual FoxPro, Hentzenwerke Publishing,2000.</li><li>Rick van der Lans, Introduction to SQL, Mastering Relational Database Language 2nd Edition, AddisonWesley, 2000.</li><li>Manual MySql, MsSql<br></li></ol>', '2022-07-01 18:25:17', '2022-07-01 18:25:17'),
('96ada341-1e6b-408d-b0d6-600cee5ed841', 'TIK1234', 'Dasar Sistem Informasi', 1, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: memahami dasar sistem informasi, peranan informasi dalam\r\nmanagemen&nbsp;<br></p>', '<p>Pendahuluan: Pengertian Dasar Tentang Sistem Informasi, Peranan Informasi dalam Manajemen;\r\nPerancangan Sistem dan Model; Sistem Informasi Manajemen Personal; Sistem Informasi Manajemen\r\nKelompok Kerja; Sistem Informasi Manajemen Organisasi; Sistem Pendukung Keputusan; Sistem Pakar;\r\nPengembangan dan Implementasi Sistem Informasi Manajemen.<br></p>', '<p>Parker, C.S., Management Information System, McGraw Hill, 1995<br></p>', '2022-07-01 18:25:24', '2022-07-01 18:25:24'),
('96ada356-2daa-47e9-9a8d-23b345e0c12d', 'TIK1328', 'Konsep Pemrograman', 1, 2015, 3, 3, 2, 6, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:Menyelesaikan permasalahan menjadi sebuah algoritma, flowchart,\r\nkemudian mengimplementasikannya menjadi sebuah program komputer.\r\nMemahami dan menggunakan konsep pemograman prosedural untuk menyelesaikan masalah.<br></p>', '<p>Pada kuliah ini akan di jelaskan dasar-dasar pemrograman meliputi algoritma, flowchart, dan pseudo code. Selanjutnya masuk ke\r\nimplementasi dengan pemrograman, di jelaskan materi-materi dasar pembuatan program meliputi : dasar- dasar pemrograman,\r\npenyeleksian kondisi, perulangan, fungsi array, string, pointer dan struktur. Bahasa pemrograman yang di gunakan adalah bahasa\r\nC<br></p>', '<ol><li>&nbsp;Brian W. Kerninghan, Dennis M. Ritchie, The C Programming Language, PrenticeHall, Englewood Cliffs, New Jersey, 1988</li><li>Steve Summit, C Programming FAQs, Addison-Wesley Publishing Company, Inc.,1996</li><li>Peter Van Der Linden, Expert C Programming Deep C Secrets, Prentice Hall,Englewood Cliffs, New Jersey,1994</li><li>Herbert Schildt, C Made Easy, Osborne-McGraw-Hill, USA, 1987.</li><li>Schildt, Herbert, Using Turbo C, Borland-Osborne-McGraw-Hill, USA, 1988.</li><li>Abdul Kadir, Pemrograman Dasar Turbo C, Andi Offset, Yogyakarta, 1992</li><li><a href=\"http://ikc.dinus.ac.id/berseri/alex-algoritma/index.php\" target=\"_blank\">ikc.dinus.ac.id</a></li><li><a href=\"http://www.wiley.com/college/busin/icmis/oakman/outline/chap05/contents.htm\" target=\"_blank\">wiley.com</a></li></ol>', '2022-07-01 18:25:38', '2022-07-01 18:25:38'),
('96ada360-9e1d-41d7-b530-a335caeeb79d', 'TIK1329', 'Workshop Keterampilan Komputer', 1, 2015, 3, 3, 2, 6, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: mengenal dari sistem komputer dan dapat merawat dan\r\nmemperbaiki komputer<br></p>', '<p>Pengantar Sistem Komputer; Organisasi Sistem Komputer; Memilih dan Menyiapakan PC; Teknik PerakitanPC; Upgrade Piranti\r\nPC; Overclocking PC; Instalasi Perangkat PC; Sistem Perawatan PC; Diagnosa,Troubleshooting dan Solusi Permasalahan pada\r\nPC</p><p>Membongkar komputer dan mengenali setiap komponen pendukung komputer, instalasi dan seting\r\nperangkat lunak termasuk sistem operasinya, percobaan upgrade sistem melalui overclock, backup sistem\r\ndengan teknik ghost, pengamanan sistem dengan freeze dan antivirus serta percobaan diagnosa kerusakan\r\nPC dengan mempergunakan perangkat keras DiagPC.&nbsp;<br></p>', '<p>Scott Mueller, Upgrading And Repairing PCs, 11th , Indiana Polis, Indiana, 1999</p><p>Null, Linda, Lobur, Julia, The Essencials Of Computer Organization And Architecture, Jones &amp; Bartlett, 200</p><p>Dr. Chip, 101Solusi Masalah PC, Elex Media Komputindo, 2003<br></p>', '2022-07-01 18:25:45', '2022-07-01 18:25:45'),
('96ada36b-7ffd-4b85-b69c-d53f7c4e68c2', 'TIK1203', 'Pancasila dan Kewarganegaraan', 1, 2015, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nMengidentifikasi dan menginterpretasikan Pancasila sebagai nilai dasar dan dasar negara, sehingga dapat memperluas wawasan\r\nberpikir mereka dan diaktualisasikan dalam kehidupan bermasyarakat, berbangsa dan bernegara.<br></p>', '<p>Filsafat pancasila: Pancasila sebagai sistem filsafat, Pancasila sebagai ideologi bangsa dan negara; Indentitas Nasional:\r\nKarakteristik Identitas Nasional, Proses berbangsa dan bernegara; Politik dan Strategi: Sistem konstitusi, Sistem politik dan\r\nketatanegaraan Indonesia; Demokrasi Indonesia: Konsep dan prinsip demokrasi, Demokrasi dan Pendidikan Demokrasi; Hak Azasi\r\nManusia dan Rule of Law; Hak azasi dan Kewajiban Warga Negara : Warga Negara Indonesia, hak dan kewajiban warga negara\r\nIndonesia; Geopolitik Indonesia: Wilayah sebagai ruang hidup, Otonomi daerah; Geotrategi Indonesia: Konsep Asia gatra,\r\nIndonesia dan Perdamaian dunia<br></p>', '<ol><li>Dardji Darmodihardjo, 1979, Pancasila Suatu Orientasi Singkat, PN Balai Pustaka, Jakarta.</li><li>Ismaun, 1981, Tinjauan Pancasila Dasar Filsafat Negara Republik Indonesia, C.V Carya Remaja, Jakarta</li><li>Nasikun, 1998, Pancasila Dalam Perspektif Reformasi: Konteks Ekonomi Pembentukan Serta Pelaksanaan Hukum di\r\nIndonesia, Pusat Studi Pancasila, UGM, Yogyakarta </li><li>M.S, Kaelan 2003, PendidikanPancasila, Paradigma, Yogyakarta</li><li>Pranarka, A W M., 1985, Sejarah Pemikiran Tentang Pancasila, CSIS, Jakarta</li><li>Toyibin Aziz. M., 1997, Pendidikan Pancasila, Rineka Cipta, Jakarta</li><li>Suny Ismail, 1980, MekanismeDemokrasiPancasila, AksaraBaru, Jakarta</li><li>Suwarno,P.J., 1993, PancasilaBudayaBangsaIndonesia, Kanisius, Yogyakarta.</li><li>PusatStudiPancasila UGM, 1992, Kebudayaan Pembangunan dalamPerspektifSejarah, Gajah Mada University Press,\r\nYogyakarta<br></li></ol>', '2022-07-01 18:25:52', '2022-07-01 18:25:52'),
('96ada381-3e43-4809-9e89-90496b40a1d5', 'TIK1204', 'Bahasa Indonesia', 1, 2015, 3, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nMemiliki pengetahuan dan kemampuan menerapkan kaidah-kaidah Berbahasa Indonesia secara baik dan benar<br></p>', '<p><b>Kedudukan bahasa Indonesia</b>: sejarah bahasa Indonesia; bahasa negara; bahasa persatuan; bahasa ilmu pengetahuan,\r\nteknologi dan seni; fungsi dan peran bahasa Indonesia dalam pembangunan bangsa.</p><p><b>Menulis:</b> makalah, rangkuman/ringkasan buku atau bab, resensi buku.</p><p><b>Membaca untuk menulis</b>: membaca tulisan/artikel ilmiah, membaca tulisan populer, dan mengakses informasi melalui internet.</p><p><b>Berbicara untuk keperluan akademik</b>: presentasi, berseminar, dan berpidato dalam situasi formal<br></p>', '<ol><li>Behling, John, Research Methods, Statistical Concepts and Research Practicum, Univ. Press of Amerika, 1987.</li><li>Setjoatmodjo, Pranjoto, Filsafat Ilmu Pengetahuan, Jakarta, PPLPTK – Ditjen Dikti. Depdikbud, 1988.</li><li>Suhardjono, Pengantar Penelitian Ilmiah, Malang, Universitas Brawijaya, Fakultas Teknik, UPT, Penerbitan.</li><li>Suriaswnantri, Jujun, Ilmu dalam Perpektif, Jakarta, Yayasan Obor Indonesia, 1970.</li><li>Sutrisno Hadi, Metodologi Reseach. Yogyakarta, Gajah Mada University Press, 1970.<br></li></ol>', '2022-07-01 18:26:06', '2022-07-01 18:26:06'),
('96ada3f3-7dfa-4e55-a3d1-406d444afa55', 'TIK2207', 'Bahasa Inggris 2', 2, 2015, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Memahami bacaan berupa teks deskripsi, Menuliskan\r\npengalaman tentang penggunaan computer dalam bahasa inggris, Menggunakan ungkapan-ungkapan meminta, menawarkan, dan\r\nmemberi bantuan serta meminta dan member informasi , Menggunakan kata kerja bentuk lampau dalam penulisan recount text ,\r\nMengungkapkan pendapat terkait tema sederhana dalam bahasa inggris, Menggunakan Adverbial clauses dalam kalimat ,\r\nMenggunakan Prepositions yang tepat dalam kaliamat&nbsp;<br></p>', '<p>Reading comprehension: function and features in a computer system, Writing recount text: an experience with computer, Past\r\ntense, Adverbial clauses, Prepositions, Expressions of asking, offering, and giving a help, Expressions of asking and giving\r\ninformation, Giving opinion about computer application in everyday life<br></p>', '<ol><li>Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents.</li><li>Englishindo. 2015. Descriptive Text: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2015/07/contoh-descriptivetext.html), accessed on February 18th, 2016)</li><li>Englishindo. 2014. ProcedureText: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2014/04/procedure-text.html),\r\naccessed on February 18th, 2016.</li><li>Esteras, Santiago Remacha. 2007. Professional English in Use: for Computer and Internet. Cambridge: Cambridge University\r\nPress</li><li>Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University\r\nPress\r\n6. Walker, Tricia. 1989. English for Academic Purposes Series Computer science. England: Cassel</li></ol>', '2022-07-01 18:27:21', '2022-07-01 18:27:21'),
('96ada3fb-29ef-4945-bec9-7e607f3d689b', 'TIK2209', 'Matematika Teknik 2', 2, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:Memiliki pengetahuan dan kemampuan menerapkan pengetahuan\r\nmatematika dalam memahami dan memecahkan masalah yang berhubungan dengan bidang teknik<br></p>', '<p><b>Integral </b>: Definisi Integral dan Rumus Dasar, Substitusi, Integral Parsial, Integral Tertentu, Aplikasi Integral : Luas Bidang.\r\n</p><p><b>Persamaan Diferensial Orde 1</b> : proses pembentukan persamaan diferensial, penyelesaian persamaan diferensial, persamaan\r\nhomogen, faktor integrasi, persamaan Bernoulli.\r\n</p><p><b>Persamaan Diferensial Orde 2 </b>: akar-akar yang real dan berbeda untuk persamaan karakteristik, akar-akar real dan sama\r\npersamaan karakteristik; Dasar-dasar Transformasi Laplace; Transformasi Laplace, Tabel Transformasi Laplace<br></p>', '<p>Anton, Howard, (1990), Elementry Linier Algebra, John Wiley International Edition.</p><p>Donovan, George, (1980), Trigonometry With Calculus, Prindle Weber &amp; Schmidt.</p><p>K.A. Stroud, (1998),Matematika Untuk Teknik, Ganeca, Bandung.\r\n</p><p>Matrik, F.Ayres, Erlangga, Latest Edition.\r\n</p><p>Purcell, Edwin, (1990), Kalkulus dan Geometrik Analitik Jilid 1, Erlangga.\r\n</p><p>Purcell, Edwin, (1990), Kalkulus dan Geometrik Analitik Jilid 2, Erlangga.<br></p>', '2022-07-01 18:27:26', '2022-07-01 18:27:26'),
('96ada414-b6d1-4f62-8dbe-bfc00b48c9e7', 'TIK2210', 'Metode Numerik', 2, 2015, 2, 3, 1, 2, '<p>Mata kuliah ini bertujuan untuk memberikan bekal pengetahuan dan kemampuan komputasi kepada mahasiswa agar mampu\r\nmenganalisa permasalahaN numerik dan melakukan komputasi untuk mencari solusi pendekatan dengan metode yang benar.<br></p>', '<p>Pengantar Komputasi Numerik, Akar Persamaan: (Metode Akolade , Metode Terbuka), Akar pada Polinomial, Diferensiasi Beda\r\nHingga dan Persamaan Diferensial Biasa<br></p>', '<p>Chapra, S. C. &amp; Canale, R., (1991). Metode Numerik Untuk Teknik (dengan Penerapan pada Komputer Pribadi). Diterjemahkan\r\noleh S. Sardy. Jakarta : UIP.\r\n</p><p>Djojodihardjo, H, (200). Metode Numerik. Jakarta : Gramedia Pustaka Utama.</p><p>Epperson, James E., (2002). An Introduction to Numerical Methods and Analysis. New York : John &amp; Wiley &amp; Sons. INC. Munir,\r\n(2003). Metode Numerik. Bandung : Informatika<br></p>', '2022-07-01 18:27:43', '2022-07-01 18:27:43'),
('96ada41b-cccc-4161-9ef4-aac8b082f011', 'TIK2230', 'Sistem Operasi', 2, 2015, 2, 1, 3, 0, '<p>Mahasiswa mampu mengoperasikan sistem komputer<br></p>', '<ol><li>Memahami prinsip sistem komputer dan dasar sistem operasi secara umum</li><li>Memahamikonsep proses, penjadwalanbanyak proses dan implementasinya</li><li>Memahamimasalah yang timbuljikabanyak proses di satusistemkomputerpadasuatusaat.\r\nBahasaninipentinguntuksistemoperasilanjut.</li><li> Memahamikonsepdasardanteknikpengelolaanmemori, sehinggaefektifdanseefisienmungkin. Memahamiprinsipprinsipmemorinyatadanmemorimaya.</li><li>Memahamiprinsip-prinsipmanajemenperangkatmasukan /keluarandanpembahasan </li><li>Instalasi Windows XP, menu-menu danteknikoperasidasar Windows XP&nbsp;<br></li></ol>', '<ol><li>William Stalling . 1998.Operating Systems. Internal and Design Principles,Addison Wesley Longman. </li><li>Rahmat M. Samik, Ibrahim, M.Sc, Masyarakat Digital GotongRoyong (MDGR). 2004. SistemOperasiKomputer, Ardi\r\nPublishing Yogyakarta </li><li>Ruth A. Watson. 2004. Introduction to Operating Systems and Networks , Upper Saddle River, New Yersey : Prentice Hall.</li><li>Richard Petersen. 2001. Linux : The Complete Reference<br></li></ol>', '2022-07-01 18:27:47', '2022-07-01 18:27:47'),
('96ada430-fcef-4c4a-b3ec-8a88b45195e0', 'TIK2331', 'Desain dan Pemrograman Web', 2, 2015, 3, 3, 2, 6, '<p>Mahasiswa memiliki pemahaman yang mendalam, kritis dan sistematis tentang karakteristik dan prinsip desain website yang\r\nbaik, mampu mendemonstrasikan bagaimana teknologi web digunakan pada situs-situs web terkini&nbsp;<br></p>', '<p><b>Teori:\r\n</b></p><p>Konsep Dasar Web; Desain Web; Review HTML; Cascading Style Sheet (CSS); Review Konsep Client-Server;\r\nAntarmuka Input Web Interaktif dan Respon Webserver; Pemrosesan Form; Pemrosesan Query, Session dan\r\nCoocies, Pengelolaan Database Berbasis Web; Content Management System (CMS).</p><p><b>Praktikum:</b></p><p>Melakukan Rekayasa Web Mempergunakan HTML, PHP, MySQL, PHPNuke CMS dan Joomla CMS<br></p>', '<ol><li>Sebesta, R.W., Programmaing the World Wide Web, Addison Wesley, 2002</li><li>Hall, M., Core Web Programming, Prentice Hall, 1998</li><li>Staab, Steffen, Semantic Web and Peer to Peer, Springer-Verlag, Berlin, 2006</li><li>Adhi Rachdian &amp; Andy Sikumbang, Mastering CMS dengan Mambo / Joomla, PT. Elex Media Komputindo,\r\nJakarta, 2005.<br></li></ol>', '2022-07-01 18:28:01', '2022-07-01 18:28:01'),
('96ada441-3f0d-466a-9fc3-784f406dd1d2', 'TIK2332', 'Pemrograman Berorientasi Obyek', 2, 2015, 3, 3, 2, 6, '<p>Kuliah ini mengajarkan konsep pemrograman berorientasi obyekdisertai contoh penerapan konsep pemrograman berorientasi\r\nobyek padabahasa Java. Pada kuliah ini mahasiswa diharapkan dapat merancang danmengimplementasikan permasalahan ke\r\ndalam konsep pemrogramanberorientasi obyek dengan diberikan tugas-tugas pemrograman dan tugasproyek.<br></p>', '<p>Konsep pemrograman berorientasi obyek yang meliputi abstraksi data, enkapsulasi, penurunan dan polymorphism.\r\nMengimplementasikan konsep pemrograman berorientasi obyek ke dalam bahasa pemrograman Java.\r\nMemecahkan masalah menjadi sebuah desain konsep pemrograman berorientasi obyek dan kemudian mengimplementasikannya\r\nmenjadi sebuah program komputer<br></p>', '<p>Sun Java Programming, Sun Educational Services, Student Guide, Sun Microsystems 2001\r\n</p><p>John R. Hubbard, Programming With Java, McGraw-Hill\r\n</p><p>Patrick Niemeyer, Jonathan Knudsen, Learning Java, O’reilly, CA, 2000\r\n</p><p>Philip Heller, Simon Roberts, Complete Java 2 Certification Study Guide, Third Edition, Sybex, 2002, San Francisco, London<br></p>', '2022-07-01 18:28:12', '2022-07-01 18:28:12'),
('96ada456-a3ce-44e6-a89f-3b28e8bd47fb', 'TIK2201', 'Pendidikan Agama Islam', 2, 2015, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Memiliki kualitas Iman, Ilmu dan Amal, memiliki wawasan yang\r\nintegratif sehingga mampu mengamalkan bidang profesinya yang dilandasi Etika Islam, mengetahui, memahami, dan menyakini\r\nkebenaran agama Islam secara integral, baik rasional, emosional, dan operasional.<br></p>', '<p>Tuhan yang maha esa dan ketuhanan: Keimanan dan Ketaqwaan, Manusia: hakikat manusia, martabat manusia, tanggung jawab\r\nmanusia; Hukum: menumbuhkan kesadaran untuk taat hukum Tuhan, fungsi profetik agama dan hukum; Moral: Agama sebagai\r\nsumber moral, akhlak mulia dalam kehidupan; Ilmu pengetahuan, Teknologi dan seni: Iman, Ipteks dan amal sebagai kesatuan,\r\nkewajiaban menuntut dan mengamalkan ilmu, tanggung jawab ilmuwan dan seniman; Kerukunan antar umat beragama: Agama\r\nmerupakan rahmat Tuhan bagi semua, kebersamaan dalam fluraritas Beragama; Masyarakat: masyarakat beradab dan sejahtera,\r\nHak azasi manusia (HAM) dan demokrasi; Budaya: budaya akademik etos kerja sikap terbuka dan adil; Politik: Kontribusi agama\r\ndalam mewujudkan persatuan dan kesatuan bangsa<br></p>', '<p>Depag, 1971, Al-qur’an dan terjemahannya, Bumi Restu, Jakarta</p><p> Gazalba, Sidi. Pokok-Pokok Ajaran Islam.\r\nMajid. </p><p>Nurcholis, 1987, Islam Modern Dan Keindonesiaan, Mizan, Bandung.\r\n</p><p>Nasution, Harus. 1982. Islam Ditinjau dari Berbagai Segi dan Aspeknya. Jakarta: UI Press.\r\n</p><p>Rahmad, Jalaludin, 1986, Islam Alternatif, Mizan, Bandung.\r\n</p><p>Sylatut, Mahmud, Islam, Aqidah dan Syariah.<br></p>', '2022-07-01 18:28:26', '2022-07-01 18:28:26'),
('96ada45f-96e1-4b9e-8eb5-fff2d35b64e3', 'TIK2335', 'Basis Data', 2, 2015, 3, 3, 2, 3, '<p>Mahasiswa mampu melakukan analisis, desain, dan implementasi basis data dan menerapkan pemrograman basis data untuk\r\nmenghasilkan aplikasi<br></p>', '<p><b>Teori :</b>\r\n</p><p>Konsep Dasar Sistem Basisdata, Basisdata Relasional, Perintah-perintah dasar SQL Menggunakan Data Definition Language\r\n(DDL), Menggunakan Data Manipulation Language (DML), Menggunakan Variabel dan Tipe Data, Menggunakan Built in Function,\r\nMembuat dan Menggunakan Join, Menggunakan View dan User authentication, Menggunakan Stored Procedure, dan\r\nMenggunakan Trigger, Backup dan Recovery.\r\n</p><p><b>Praktikum :</b></p><p>Malakukan Rekayasa Sistem Basis Data Sesuai Materi Basis Data&nbsp;<br></p>', '<ol><li>Silberschatz, Korth, Sudarshan, Database System Concept, Foxit Software Company, 2014</li><li>Celko Joe, SQL Programming Stule, Elsevier, 2015.\r\n3. Rivero, Laura C, Encyclopedia of Database Technologies and Application, IDEA Group, 2005.\r\n4. Akins Marcia, 1001 Things You Know About Visual FoxPro, Hentzenwerke Publishing,2000.\r\n5. Rick van der Lans, Introduction to SQL, Mastering Relational Database Language 2nd Edition, AddisonWesley, 2000.\r\n6. Manual MySql, MsSql<br></li></ol>', '2022-07-01 18:28:32', '2022-07-01 18:28:32'),
('96ada479-a84a-47ad-95eb-57fa7db1f7db', 'TIK2236', 'Praktek Dasar Sistem Informasi', 2, 2015, 2, 2, 0, 4, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nMemilikipemahaman dan keterampilan dalam membuat rancangan pengembangan sistem informasi bagi\r\nperusahaan/organisasi<br></p>', '<p><b>Praktikum :</b></p><p>Melakukan Rekayasa Pengembangan Sistem Informasi, Sistem Manajemen Database, Analisis Biaya Investasi Teknologi\r\nInformasiData Flow Diagram (DFD),Entity Relationship Diagram (ERD),Flow Chart,Rancangan File,Rancangan Interface\r\ndanRancangan Pseudocode&nbsp;<br></p>', '<ol><li>Sutabri ,Tata.,Analisis Sistem Informasi, Urindo, Jakarta 2012</li><li>Jogiyanto, Hartono.,Sistem Teknologi Informasi, Andi, Yogyakarta</li></ol>', '2022-07-01 18:28:49', '2022-07-01 18:28:49'),
('96ada4eb-0071-43bd-b35a-158ca8ef9135', 'TIK3212', 'Bahasa Ingris Profesi', 3, 2015, 2, 3, 1, 2, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Memperkenalkan diri sendiri dan orang lain,Mengidentifikasi\r\nbagian-bagian surat lamaran kerja, Menulis surat lamaran kerja yang efektif, Mengidentifikasi pertanyaan-pertanyaan yang muncul\r\npada saat wawancara beserta jawabannya, Mengidentifikasi bagian-bagian memo dan e-mail, Menullis memo dan e-mail dengan\r\nbenar, Mengidentifikasi beberapa singkatan dalam chatting, Menulis lowongan pekerjaan yang efektif, Menggunakan future tense\r\ndalam kalimat<br></p>', '<p>Introducing yourself and others, Parts of application letter, Comprehending the content of application letter, Writing application\r\nletters, Comprehending some questions in job interview, Kinds of personal letter: e-mail and memo, Parts of personal letters,\r\nWriting personal letters, Chat abbreviation, Parts of job advertisement, Comprehending job advertisement, Writing job\r\nadvertisement<br></p>', '<ol><li>Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents.</li><li>Englishindo. 2015. Descriptive Text: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2015/07/contoh-descriptivetext.html), accessed on February 18th, 2016)</li><li>Englishindo. 2014. ProcedureText: Materi dan Contoh Terlengkap. (http://www.englishindo.com/2014/04/procedure-text.html),\r\naccessed on February 18th, 2016.</li><li>Esteras, Santiago Remacha. 2007. Professional English in Use: for Computer and Internet. Cambridge: Cambridge University\r\nPress</li><li>Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University\r\nPress</li><li>Walker, Tricia. 1989. English for Academic Purposes Series Computer science. England: Cassel<br></li></ol>', '2022-07-01 18:30:03', '2022-07-01 18:30:03'),
('96ada4f2-ff66-400e-9756-ebe989fcb085', 'TIK3213', 'Matematika Diskrit', 3, 2015, 2, 1, 3, 0, '<p>Mata kuliah ini memberikan kemampuan berpikir logika, sehingga dapatmengidentifikasi data diskrit yang diberikan,\r\nmerumuskannya secara sederhana, untuk siap mejadi masukan dan proses dalam pemrograman komputer untuk\r\nmenyelesaikan masalah umum yang sifatnya diskrit.<br></p>', '<p><b>Logika : </b>Proposisi, Mengkombinasika Proposisi, Hukum-hukum Logika Proposisi, Inferensi, Argumen.\r\n</p><p><b>Himpunan</b> : Definisi Himpunan, Diagram Venn, Operasi Himpunan, Aljabar Himpunan, Pembuktian Proposisi Himpunan,\r\nHimpunan Ganda</p><p><b>Matriks, Relasi, dan Fungsi </b>: Matriks, Relasi, Relasi invers, Komposisi Relasi, Sifat-sifat Relasi, Fungsi, Fungsi Invers, komposisi\r\nFungsi, Fungsi Rekursif.</p><p><b>Kombinatorial dan Peluang Diskrit</b> : Permutasi dan Kombinasi, Permutasi dan Kombinasi Bentuk Umum, Kombinasi dengan\r\nPengulangan, Peluang Diskrit.</p><p><b>Graf</b> : Definisi Graf, Jenis-jenis Graf, Graf Sederhan Khusus.</p><p><b>Aplikasi Graf</b> :Pohon, Pohon Biner, Pohon Rentang, Lintasan Terpendek.<br></p>', '<ol><li>Jong. J.S., (2006), MatematikaDiskritdanAplikasinyapadaIlmuKomputer, Edisi Ketiga, PenerbitAndi</li><li>Munir, R., (2005), Matematika Diskrit, Revisi Kelima, Bandung : Informatika.</li></ol>', '2022-07-01 18:30:08', '2022-07-01 18:30:08'),
('96ada4f8-ed01-47ad-8f44-4303d70d225b', 'TIK3337', 'Konsep Jaringan', 3, 2015, 3, 3, 1, 5, NULL, NULL, NULL, '2022-07-01 18:30:12', '2022-07-01 18:30:12'),
('96ada4fd-e448-4a63-8ba6-baee8b281747', 'TIK3238', 'Data Base Clien server', 3, 2015, 2, 3, 1, 3, '<p>Mahasiswa mampu melakukan analisis, desain, dan implementasi basis data dan menerapkan pemrograman basis data untuk\r\nmenghasilkan aplikasi.<br></p>', '<p><b>Teori :</b></p><p>Perkenalan SQL, Fungtsi Single-Row, Fungsi Agregasi Data, Subquery, Manajemen Transaksi, Sequnce dan Index, Struktur Blok\r\nPL/SQL, Dasar-dasar PL/SQL, Interaksi PL/SQL dengan Oracle, Kondisi dan Perulangan, Pengenelan Eksepsi.\r\n</p><p><b>Praktikum :</b></p><p>\r\nMalakukan Rekayasa Sistem Basis Data Sesuai Materi Teori Konsep Database Clien Server<br></p>', '<ol><li>Silberschatz, Korth, Sudarshan, Database System Concept, Foxit Software Company, 2014</li><li>Celko Joe, SQL Programming Stule, Elsevier, 2015.</li><li>Rivero, Laura C, Encyclopedia of Database Technologies and Application, IDEA Group, 2005.</li><li>Akins Marcia, 1001 Things You Know About Visual FoxPro, Hentzenwerke Publishing,2000.</li><li>Rick van der Lans, Introduction to SQL, Mastering Relational Database Language 2nd Edition, AddisonWesley, 2000.</li><li>Manual MySql, MsSql<br></li></ol>', '2022-07-01 18:30:16', '2022-07-01 18:30:16'),
('96ada503-59af-44eb-83f2-f2204eb15b55', 'TIK3249', 'Interaksi Manusia dan Komputer', 3, 2015, 2, 1, 2, 0, '<p>Memahami konsep, berbagaia spek dan implementasi IMK dalam perangkat keras maupun perangkat lunak.<br></p>', '<p>Memberikan pemahaman teori dan paraktek interaksi manusia dan komputer (IMK) yang meliputi :Konsep IMK, factor manusia,\r\naspek ergonomik, piranti interaktif, ragam dialog, desain input, desain output, desain dialog, desain web, desain presentasi dan\r\npemrograman grafis<br></p>', '<ol><li>Downtown, Andy, Engineering the Human-Computer Interface, Mc. Graw Hill International, 1992</li><li>Gould, Johm D., How to Design Usable Systen: Researc Report, IBM Research Centre, New York, 1987</li><li>Jeffry L. Whitten, dkk, Sistem Analysis &amp;DesgnMethods,St. Louis: Times Mirror / Mosby College Publishing 1986<br></li></ol>', '2022-07-01 18:30:19', '2022-07-01 18:30:19'),
('96ada508-c70e-4bea-bc85-5307d763589e', 'TIK3321', 'Rekayasa Perangkat Lunak', 3, 2015, 3, 3, 1, 5, '<p>Mahasiswa Memahami konteks pengenembangan perangkat lunak dan mampu mengaplikasikanya dalam berbagai studi kasus,\r\nyang meliputi perencanaan, analisis, desain, pemodelam, implementasi, dan pengoperasian perangkat lunak.<br></p>', '<p>Matakuliah ini membahas tentang konteks perangkat lunak sebagai produk dan proses, rekayasa sistem, konsep dan prinsip\r\nanalisis, pemodelan analisis, desain sistem, desain database, desain output, desain input, desain dialog, pemodelan UML,\r\nimplementasi sistem, operasi dan dukungan sistem,<br></p>', '<ol><li>Tavri D. Mahyuzir.1997. Pengantar Rekayasa Perangkat Lunak. Elexmedia Komputindo.</li><li>Pressman, Roger .2001.Software Engineering : A Practitioner Approach, 5th edition. McGraw:Hill International.</li><li>Sommervile, Ian.2003. Software Engineering, 7th. Addison Wesley : Publishing Company.<br></li></ol>', '2022-07-01 18:30:23', '2022-07-01 18:30:23'),
('96ada50f-8cc4-4b2a-9d3f-c9ba64175027', 'TIK3220', 'Analisa Perancangan Sistem Informasi', 3, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nMemiliki pemahaman dan keterampilan dalaman alisis, pengembangan, pemahaman serta pengembangan sistem informasi.<br></p>', '<p>Konteks metode analisis dandesain sistem, blok pembangun sistem, pengembangan system informasi, manajemen proyek,\r\nanalisis sitem, teknik penemuan fakta, pemodelan persyaratan system menggunakan Use Case, pemodelan dan Analisis Data,\r\nAnalisis Kelayakan dan Pemodelan berorientasi obyek menggunakan UML. Dan Memahami konsep system informasi,\r\npengembangannya, berbagai teknik analisis, dan mampu mengimplementasikan dalam berbagai kasus pengembangan\r\nsisteminformasi.<br></p>', '<ol><li>Rich, E., Knight, K., 1991. Artificial Intelligent, Singapore : McGraw-Hill Book Co</li><li>Setiawan, S., 1993. Artificial Intelligent, Yogyakarta : PenerbitAndi Offset</li><li>Kusumadewi, S. Artificial intelligence, Yogyakarta : PenerbitAndi Offset</li><li>Ungkawa, U., 1992. BahasaPemrogramanLogika Turbo PROLOG, Yogyakarta :PenerbitAndi Offset.<br></li></ol>', '2022-07-01 18:30:27', '2022-07-01 18:30:27'),
('96ada515-1826-45d0-aacf-1ae76954a2cc', 'TIK3215', 'Organisasi dan Arsitektur Komputer', 3, 2015, 2, 1, 3, 0, '<p>Agar mahasiswa dapat mengetahui mengenai arsitektur dan organisasi komputer.<br></p>', '<p>Pendahuluan, Arsitektur dan Organisasi Komputer, Computer Evolution and Performance, Sistem Bus, Cache Memori, Memori\r\nInternal, Memori Eksternal, Modul I/O, Operating System Support, Computer Arithmetic, Instruction Sets: Characteristics and\r\nfungsi, Instruction Sets: Addressing Modes and Formats, Struktur dan Fungsi CPU.<br></p>', '<ol><li>Computer Organization and Architecture, William Stalling, Fifth Edition, prentice Hall, 2000</li><li>Computer Organization Architecture, Andrew S. Tanenbaum prentice Hall, 1999</li><li>Computer Organization, Hamacher, McGraw Hill, 1990</li><li>Applied Operating System concept, Avi Silberschatz, peter Galvin, Greg Gagne, John Wiley Inc 2000<br></li></ol>', '2022-07-01 18:30:31', '2022-07-01 18:30:31'),
('96ada51b-3d73-40dc-b30c-24ff07730dda', 'TIK3339', 'Multimedia', 3, 2015, 3, 2, 0, 8, '<p>Mahasiswa mampu menghasilkan karya menggunakan perangkat lunak yang dapat mengolah suara dan gambar<br></p>', '<p>Mahasiswa mampu menjelaskan gambaran pemahaman umum tentang mata kuliah Komputer Multimedia dan diperkenalkan\r\ndengan fitur – fitur pada perangkat lunak Adobe Premier Pro, perangkat lunak Adobe After Effects, perangkat lunak macromedia\r\nflash&nbsp;<br></p>', NULL, '2022-07-01 18:30:35', '2022-07-01 18:30:35'),
('96ada57d-ea31-4e3f-879a-f686dbc27cf1', 'TIK4216', 'Manajemen Proyek Sistem Informasi', 4, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat memahami dan menumbuhkan pengetahuan mengenai fungsi\r\nmanajemen, khususnya dalam proyek teknologi informasi, mulai tahap inisiasi, perencanaan, pelaksanaan, pengendalian, dan\r\npengakhiran, serta dapat memanfaatkan tool dan teknik yang terdapat dalam bidang manajemen proyek. Dengan pemahaman dan\r\nketerampilan tersebut diharapkan dapat memanfaatkan dan mengembangkan teknik-teknik manajemen sehingga dapat menjadi\r\nlandasan dalam perancangan dan pengembangan sistem informasi.<br></p>', '<ol><li>Pengantar Manajemen Proyek</li><li>Inisiasi, Perencanaan, dan Eksekusi Proyek</li><li>Konteks dan Proses Dalam Manajemen Proyek</li><li>Pengontrolan Aktivitas Proyek</li><li>Manajemen Integrasi Proyek/Project Integration</li><li>Pengakhiran Proyek/Project Closing</li><li>Manajemen Ruang Lingkup Proyek/Project Scope</li><li> Manajemen Waktu Proyek/Project Time Management</li><li>Manajemen Biaya Proyek/Project Cost Management</li><li>Manajemen Kualitas Proyek/Project Quality Management</li><li>Manajemen SDM/ Project Human Resource Management</li><li>Manajemen Komunikasi Dalam Proyek/Project Communication Management</li><li>Manajemen Risiko Dalam Proyek/Project Risk Management </li><li>Manajemen Pengadaan Proyek/Project Procurement Management<br></li></ol>', '<ol><li>Iman Soeharto. Manajemen Proyek: dari konseptual sampai operasional. Jakarta: Erlangga. 1999.</li><li>Project Management Institute. A Guide to the Project Management Body of Knowledge: PMBOK Guide Edition 5, PMI, , 2013</li><li>Kathy Schwalbe. Information Technology Project Management. Cengage Learning. 2016.</li><li>Rudy Tantra. Manajemen Proyek Sistem Informasi. Andi Offset. 2012.</li><li>Poject Management Isntitute. PMBoK 6th Guide Edition in Bahasa Indonesia/Pedoman Kerangka Ilmu Manajemen Proyek: Edisi\r\nKeenam. PMI.<br></li></ol>', '2022-07-01 18:31:40', '2022-07-01 18:31:40'),
('96ada584-07e7-48e5-baa3-c81cea63d0c1', 'TIK4206', 'Ilmu Sosial Budaya Dasar', 4, 2015, 2, 1, 3, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nmenjadi ilmuwan dan profesional yang berpikir kritis, kreatif, sistematik dan ilmiah, berwawasan luas, etis, memiliki kepekaan dan\r\nempati sosial, bersikap demokratis, berkeadaban, serta dapat ikut berperan mencari solusi pemecahan masalah sosial dan budaya\r\nsecara arif<br></p>', '<ol><li>Pengantar ISBD </li><li>Manusia Sebagai Makhluk Budaya</li><li>Manusia Sebagai Makhluk Individu dan Sosial</li><li>Manusia dan Peradaban</li><li>Manusia, Keragaman, dan Kesetaraan</li><li>Manusia, Nilai, Moral, dan Hukum</li><li>Manusia, Sains, Teknologi dan Seni</li><li>Manusia dan Lingkungan<br></li></ol>', '<ol><li>Herimanto dan Winarno. Ilmu Sosial Budaya Dasar. Bumi Aksara. 2013</li><li>Sarinah. Ilmu Sosial Budaya Dasar (di Perguruan Tingi)</li><li>Lies Sudibyo, dkk. Ilmu Sosial Budaya Dasar. Andi Publisher. 2013.<br></li></ol>', '2022-07-01 18:31:44', '2022-07-01 18:31:44'),
('96ada58b-abbc-4fd7-a7de-cc7a57b59d61', 'TIK4217', 'Sistem Pendukung Keputusan', 4, 2015, 2, 1, 3, 0, '<p>Mahasiswa mengerti dan mampu menerapkan konsep pengambilan keputusan dalam organisasi memanfaatkan sistem berbasis\r\nkomputer untuk mendukung pengambilan keputusan.<br></p>', '<ol><li>Proses pengambilan keputusan (Proses pengambilan keputusan, jenis permasalahan dalam model keputusan, Tahapan\r\nPengambilan Keputusan, LKlasifikasi Pengambilan Keputusan, Klasifikasi Pengambilan Keputusan, Klasifikasi Model Data,\r\nKlasifikasi Solusi,Multicriteria decision making) (MCDM), (Multi Objective Decision Making (MODM)</li><li>Sistem pendukung keputusan (Menjelaskan Tahapan Pengembangan SPK)</li><li>Metode Pembobotan</li><li>SAW</li><li>AHP</li><li>TOPSIS</li><li>VIKOR </li><li>ELECTRE</li><li>FUZZY<br></li></ol>', '<ol><li>Dicky Nofriansyah, S.Kom.,M.Kom (Konsep Data Mining Vs Sistem Pendukung Keputusan)</li><li>Diana, S.Si.m M.Kom ( Metode dan Aplikasi Sistem Pendukung Keputusan)</li><li>Irfan Subakti, Sistem Pendukung Keputusan (Decision Support System), ITS, Surabaya, 2002.</li><li>Yayasan Kita Menulis (Sistem Pendukung Keputusan metode dan implementasi)<br></li></ol>', '2022-07-01 18:31:49', '2022-07-01 18:31:49'),
('96ada592-0e15-4adf-8785-fab583d605ab', 'TIK4340', 'Keamanan Jaringan', 4, 2015, 3, 2, 0, 6, '<p>Mahasiswa mampu memahami dan seterusnya melakukan perancangan dan menerapkan aspek-aspek keamanan dalam sistem\r\nyang tersambung ke jaringan komputer<br></p>', '<p>Perkuliahan ini akan mengangkat bahasan tentang pemahaman pentingnya keamanan komputer, keamanan\r\npertukaran data dalam jaringan komputer serta teknik-teknik pengamanannya.\r\nPendahuluan tentang keamanan jaringan, pengertian enkripsi dan dekripsi data, teknik pengamanan\r\nprogram dari serangan luar: backup, antivirus dan personal firewall, pengaturan otorisasi, pengamanan\r\nsistem operasi, pengamanan sistem basis data, pengamanan jaringan komputer : pinging, network firewall,\r\npengaturan keamanan dan studi kasus pada biometrik.<br></p>', '<p>Angus Wong and Alan Yeung, “Network Infrastructure Security’, Springer, 2009“Definitions: IT Security Architecture\r\n”, SecurityArchitecture.org, Jan, 2008</p><p>“New hacking technique exploits common programming error”. SearchSecurity.com, July 2007E. Stewart Lee\r\n, “Essays about Computer Security”, Cambridge, 1999\r\n</p><p>Morrie Gasser, “Building a secure computer system “, ISBN 0-442-23022-2 1988&nbsp;<br></p>', '2022-07-01 18:31:53', '2022-07-01 18:31:53'),
('96ada598-f2f2-44b8-9b8c-2fb0749b7e09', 'TIK4341', 'Proyek 1', 4, 2015, 3, 2, 0, 8, '<p>Mahasiswa mampu merancang sistem informasi sesuai dengan studi kasus yang dipilih<br></p>', '<p><b>Praktikum :</b>\r\n</p><ol><li>Pengajuan dan Verifikasi Judul Penelitian</li><li>Bimbingan Penyusunan Laporan Penelitian</li><li>Pendaftaran Seminar Penelitian</li><li>Pelaksanaan Seminar Penelitian</li><li>Revisi Laporan Penelitian Pasca Seminar</li><li>Pengumpulan Hasil Penelitian<br></li></ol>', '<ol><li>Buku Panduan Penulisan Proyek 1 Program Studi Teknik Informatika Politeknik Negeri Ketapang<br></li></ol>', '2022-07-01 18:31:57', '2022-07-01 18:31:57'),
('96ada5a0-4faf-44d4-a8d0-6797b5b3410d', 'TIK4224', 'Kecerdasan Buatan', 4, 2015, 2, 3, 1, 2, '<ol><li>Mahasiswa mengerti konsep dasar sistem cerdas: fuzzy logic, neural network dan algoritma genetika.</li><li>Mahasiswa mengerti dan mampu menerapkan sistem cerdas dalam aplikasi sederhana.<br></li></ol>', '<ol><li>Pengantar Kecerdasan Buatan</li><li>Sistem Pakar</li><li>Case Based Reasoning</li><li>Rule Based Reasoning</li><li>Jaringan Syaraf Tiruan</li><li>Logika Fuzzy</li><li>Algoritma Genetika<br></li></ol>', '<ol><li>Sri Kusumadewi, 2004, Aplikasi Logika Fuzzy Untuk Pendukung Keputusan, Graha Ilmu, Yogyakarta.</li><li>Son Kuswadi, 2000, Kendali Cerdas, DiktatKuliah Politeknik ITS, Surabaya</li><li>Arief Hermawan,2006, Jaringan Syaraf Tiruan Teori dan Aplikasi, Penerbit Andi, Yogyakarta.</li><li>Suyanto, 2005, Algoritma Genetika dalam Matlab, Penerbit Andi, Yogyakarta.</li><li>Sri Kusumadewi, 2002, Analisis dan Desain Sistem Fuzzy Menggunakan Toolbox Matlab, Graha Ilmu, Yogyakarta.<br></li></ol>', '2022-07-01 18:32:02', '2022-07-01 18:32:02'),
