('96ada679-baa1-4ead-8019-53eb5ae3c1f5', 'TIK4214', 'Bahasa Ingris Informatika', 4, 2015, 2, 3, 2, 1, '<p><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Membedakan antara fakta dan pendapat, Menggunakan</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">ungkapan-ungkapan yang tepat untuk meminta dan memberikan pendapat, Menggunakan ungkapan-ungkapan yang tepat untuk</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">menyetejui dan tidak menyetujui , Menggunakan Comparative and superlative degree untuk membandingkan dua perihal atau</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">lebih, Mengidentifikasi jenis-jenis pertanyaan dan penggunaannya, Mengindentifikasi Precautions and warning dalam buku petunjuk</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">penggunaan computer, Mempresentasikan isu-isu terkait penggunaan computer&nbsp;</span><br></p>', '<p><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">Facts and opinions, Comparative and superlative degree, Expressions of asking and giving opinion , Expressions of agreeing and</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">disagreeing, Kinds of question: Yea/ No Question and WH-Question, Precautions and warnings, Expressions for opening</span><br style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\">presentation, The way to present power points slides, Expressions to close the presentation</span><br></p>', '<ol style=\"color: rgb(128, 128, 128); font-family: Rubik, sans-serif; text-align: justify;\"><li style=\"list-style: none; margin: 0px; padding: 0px;\">Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Esteras, Santiago Remacha. 2007. Professional English in Use: for Computer and Internet. Cambridge: Cambridge University<br>Press</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University<br>Press</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Walker, Tricia. 1989. English for Academic Purposes Series Computer science. England: Cassel</li></ol>', '2022-07-01 18:34:25', '2022-07-01 18:34:25'),
