('96ada895-b152-4589-b68e-b70dffaae7ac', '-', 'Olah Raga', 1, 2019, 0, 1, 0, 0, NULL, NULL, NULL, '2022-07-01 18:40:18', '2022-07-01 18:40:18'),
('96ada8a3-574f-4cff-bcce-92f17840218f', 'PNK-0203', 'Pendidikan Pancasila', 1, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Memiliki kepribadian dalam berfikir, bersikap dan bertindak sesuai\r\ndengan nilai-nilai Pancasila<br></p>', '<ol><li>Pengantar Pendidikan Pancasila</li><li>Pancasila Dalam Arus Sejarah Bangsa Indonesia</li><li>Pancasila Sebagai Dasar Negara</li><li>Pancasila Sebagai Ideologi Negara</li><li>Pancasila Sebagai Sistem Filsafat</li><li>Pancasila Sebagai Sistem Etika</li><li>Pancasila Sebagai Dasar Pengembangan Ilmu<br></li></ol>', '<ol><li>Direktorat Jenderal Pembelajaran dan Kemahasiswaan, (2016). Pendidikan Pancasila Untuk Perguruan Tinggi. Jakarta</li><li>Kaelan,, (2008). Pendidikan Pancasila, Paradigma, Yogyakarta.<br></li></ol>', '2022-07-01 18:40:27', '2022-07-01 18:40:27'),
('96ada8a9-dfb2-49b8-9fc7-5e71f2698137', 'PNK-0204', 'Kewarganegaraan', 1, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Menjadi Profesional yang memiliki rasa kebangsaan dan cinta tanah\r\nair<br></p>', '<ol><li>Hakikat Pancasila dan Kewarganegaraan</li><li>Hak dan Kewajiban Warga Negara</li><li>Identitas Nasional</li><li>Demokrasi</li><li>Penegakan Hukum dan HAM</li><li>Gender</li><li>Wawasan Nusantara</li><li>Ketahanan Nasional</li><li>Pendidikan Anti Korupsi<br></li></ol>', '<ol><li>Direktorat Jenderal Pembelajaran dan Kemahasiswaan, (2016). Pendidikan Kewarganegaraan Untuk Perguruan Tinggi.</li><li>Asep Sahid Gatara, Subhan Sofhian, (2012). Pendidikan Kewarganegaraan (Civic Education).<br></li></ol>', '2022-07-01 18:40:32', '2022-07-01 18:40:32'),
('96ada8b0-4340-441a-9261-6f78ae7c5bfd', 'PNK-0205', 'Matematika', 1, 2019, 2, 1, 2, NULL, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:Memiliki pengetahuan dan kem<br></p>', '<ol><li>Sistem Bilangan Riil, Bilangan Biner dan Bilangan Kompleks</li><li>Sistem Bilangan dan Barisan dan Deret</li><li>Fungsi Satu Peubah:</li><li>Turunan: Teknik Turunan, Aturan rantaii, Turunan Implisit. Aplikasi turunan; grafik fungsi(polinomial dan pecahan rasional)</li><li>Integral Tertentu : Konsep Dasar Integral Tententu, Substitusi, Integral Parsial</li><li>Integral Tak Tentu : Konsep Dasar Integral Tententu, Substitusi, Integral Parsial</li><li>Persamaan Diferensial&nbsp;<br></li></ol><p><br></p>', '<ol><li>Stroud, K.A. (1987). Matematika Untuk Teknik (terjemahan oleh: Erwin Sucipto). Edisi Ketiga. Jakarta: Erlangga.</li><li>Arhami, Muhammad. (2018). Kalkulus Untuk Politeknik. Edisi 1. Yogyakarta: Andi.</li><li>Purcell, Edwin. (1990). Kalkulus dan Geometrik Analitik Jilid 1. Jakarta: Erlangga.</li><li>Purcell, Edwin. (1990). Kalkulus dan Geometrik Analitik Jilid 2. Jakarta: Erlangga<br></li></ol>', '2022-07-01 18:40:36', '2022-07-01 18:40:36');
INSERT INTO `mata_kuliah` (`id`, `kode`, `nama`, `semester`, `kurikulum`, `sks`, `jenis_mk`, `jam_teori`, `jam_praktikum`, `tiu`, `bahasan`, `referensi`, `created_at`, `updated_at`) VALUES
('96ada8b6-38a3-4148-9eb3-f4f77eff5fd1', 'PNK-0206', 'Bahasa Inggris 1', 1, 2019, 2, 1, 2, NULL, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan mampu menggunakan Bahasa Inggris secara lisan maupun tulisan dalam\r\nbentuk: meminta dan memberikan personal information, mengidentifikasi kata benda bentuk tunggal dan jamak, menggunakan\r\nsimple present, simple past, simple future , kata sifat dan adverb, serta mampu menulis jenis teks tertentu seperti teks deskriptif dan\r\nprosedur.<br></p>', '<ol><li>Asking and giving personal information</li><li>Singular and plural noun</li><li>Tenses</li><li>Adverb</li><li>Adjective</li><li>Writing a descriptive text</li><li>Writing a procedure text<br></li></ol>', '<ol><li>Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents.</li><li>Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University Press </li><li>Walker, Tricia. 1989. English for Academic Purposes Series Computer science. England: Cassel</li><li>Sumber internet lainnya<br></li></ol>', '2022-07-01 18:40:40', '2022-07-01 18:40:40'),
('96ada8bb-bb57-40ac-ad0f-5eba7cddd6d9', 'TIF-1213', 'Pengantar Teknologi Informasi', 1, 2019, 3, 3, 2, 1, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat mengetahui perkembangan teknologi informasi terkini dan\r\nmemanfaatkan Teknologi Informasi serta kaitannya dengan bidang-bidang lain<br></p>', '<p>Mata kuliah ini akan memberikan pengetahuan dasar bagi mahasiswa tentang perkembangan teknologi informasi yang meliputi :\r\nTeknologi Komputer, Teknologi Telekomunikasi, dan Jaringan Komputer.</p><ol><li>Memahami konsep dasar Teknologi Informasi</li><li>Memahami Sistem Komputer dan fungsinya</li><li>Memahami Konsep Dasar Arsitektur Sistem Komputer</li><li>Memahami Konsep Dasar Teori Bilangan</li><li>Memahami Konsep Dasar Sistem Komunikasi dan Teknologi Internet</li><li>Memahami Konsep Dasar Sistem Jaringan</li><li>Memahami Konsep Dasar Basisdata</li><li>Mengetahui Beberapa Bidang Aplikasi dari Teknologi</li><li>Mengetahui Perkembangan Teknologi Informasi Terkini<br></li></ol>', '<ol><li>Simarmarta, Janner. 2006. Pengenalan Teknologi Komputer dan Informasi, Andi, Yogyakarta.</li><li>Kadir, Abdul, Triwahyudi, Terra CH. 2005. Pengenalan Teknologi Informasi, Andi, Yogyakarta.<br></li></ol>', '2022-07-01 18:40:43', '2022-07-01 18:40:43'),
('96ada8c1-f43d-45ff-aad8-1090c0de05af', 'TIF-1314', 'Konsep Basis Data', 1, 2019, 3, 3, 2, 1, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa mampu memodelkan data dan informasi dalam bentuk diagram konsep dan diagram\r\nfisik serta menerapkannya ke dalam basis data, serta mampu memahami konsep manipulasi data.<br></p>', '<p><b>Teori :\r\n</b></p><ol><li>Pengenalan Basis Data</li><li>Lingkup Basis Data</li><li>Model Relasional Basis Data</li><li>Tipe Data</li><li>Desain Basis Data</li><li>Relational, Data Definition Language (DDL)</li><li>Data Manipulation Language (DML)</li><li>Konsep Query (View)</li><li>Normalisasi&nbsp; &nbsp;&nbsp;</li></ol><p><b style=\"font-size: 1rem;\">Praktikum :</b></p><p></p><ol><li><span style=\"font-size: 1rem;\">Malakukan Rekayasa Sistem Basis Data Sesuai Materi Teori Konsep Basis Data</span><br></li></ol>', '<ol><li>Silberschatz A., Korth HF., Sudarshan S. 2014. Database System Concept. Foxit Software Company.</li><li>Fathansyah. 2018. Basis Data Revisi Ketiga. Bandung: Informatika.</li><li>Abdul Kadir, Konsep dan Tuntunan Praktis Basis Data. Yogyakarta: Andi</li><li>Manual MySql, MsSql<br></li></ol>', '2022-07-01 18:40:47', '2022-07-01 18:40:47'),
('96ada8c8-4b2d-45ea-bdd8-6f9db02d9a8a', 'TIF-1316', 'Konsep Pemrograman', 1, 2019, 3, 3, 2, 1, '<ol><li>Mahasiswa dapat menyelesaikan permasalahan menjadi sebuah algoritma, flowchart kemudian mengimplementasikannya\r\nmenjadi sebuah program Komputer.</li><li>Mahasiswa dapat menyelesaikan Memahami dan menggunakan konsep pemrograman prosedural untuk menyelesaikan masalah<br></li></ol>', '<p><b>Teori :</b></p><p>Pada mata kuliah ini akan dijelaskan dasar-dasar pemrograman seperti pemahaman mengenai Algoritma, Flowchart dan Pseudo\r\nCode. Selanjutnya Mahasiswa akan melakukan implementasi pembuatan program dengan Bahasa pemrograman C maupun C++\r\nmeliputi materi:&nbsp;</p><ol><li>Dasar-dasar Pemrograman</li><li>Variabel, Konstanta dan Tipe Data</li><li>Operator dan Ekspresi</li><li>Manajemen Input Output</li><li>Penanganan Kondisi</li><li>Perulangan</li><li>Pengguaan Larik (Array)</li><li>. Penggunaan Fungsi dan Pemrograman Terstruktur</li><li>Debuging</li></ol><p><b>Praktikum :</b></p><p><b>\r\n</b>Malakukan Rekayasa Sistem Basis Data Sesuai Materi Teori Konsep Basis Data<br></p>', '<ol><li>Abdul Kadir, Algoritma &amp; Pemrograman menggunakan C &amp; C++, Andi Offset, Yogyakarta, 2012</li><li>Brian W. Kerninghan, Dennis M. Ritchie, The C Programming Language, PrenticeHall, Englewood Cliffs, New Jersey, 1988</li><li>Steve Summit, C Programming FAQs, Addison-Wesley Publishing Company, Inc.,1996</li><li>Peter Van Der Linden, Expert C Programming Deep C Secrets, Prentice Hall,Englewood Cliffs, New Jersey,1994</li><li>Herbert Schildt, C Made Easy, Osborne-McGraw-Hill, USA, 1987.<br></li></ol>', '2022-07-01 18:40:52', '2022-07-01 18:40:52'),
('96ada8ce-12c2-41f2-b0d6-2baf60b26e36', 'TIF-1316', 'Konsep Pemrograman', 1, 2019, 3, 3, 2, 1, '<ol><li>Mahasiswa dapat menyelesaikan permasalahan menjadi sebuah algoritma, flowchart kemudian mengimplementasikannya\r\nmenjadi sebuah program Komputer.</li><li>Mahasiswa dapat menyelesaikan Memahami dan menggunakan konsep pemrograman prosedural untuk menyelesaikan masalah<br></li></ol>', '<p><b>Teori :</b></p><p>Pada mata kuliah ini akan dijelaskan dasar-dasar pemrograman seperti pemahaman mengenai Algoritma, Flowchart dan Pseudo\r\nCode. Selanjutnya Mahasiswa akan melakukan implementasi pembuatan program dengan Bahasa pemrograman C maupun C++\r\nmeliputi materi:&nbsp;</p><ol><li>Dasar-dasar Pemrograman</li><li>Variabel, Konstanta dan Tipe Data</li><li>Operator dan Ekspresi</li><li>Manajemen Input Output</li><li>Penanganan Kondisi</li><li>Perulangan</li><li>Pengguaan Larik (Array)</li><li>. Penggunaan Fungsi dan Pemrograman Terstruktur</li><li>Debuging</li></ol><p><b>Praktikum :</b></p><p><b>\r\n</b>Malakukan Rekayasa Sistem Basis Data Sesuai Materi Teori Konsep Basis Data<br></p>', '<ol><li>Abdul Kadir, Algoritma &amp; Pemrograman menggunakan C &amp; C++, Andi Offset, Yogyakarta, 2012</li><li>Brian W. Kerninghan, Dennis M. Ritchie, The C Programming Language, PrenticeHall, Englewood Cliffs, New Jersey, 1988</li><li>Steve Summit, C Programming FAQs, Addison-Wesley Publishing Company, Inc.,1996</li><li>Peter Van Der Linden, Expert C Programming Deep C Secrets, Prentice Hall,Englewood Cliffs, New Jersey,1994</li><li>Herbert Schildt, C Made Easy, Osborne-McGraw-Hill, USA, 1987.<br></li></ol>', '2022-07-01 18:40:55', '2022-07-01 18:40:55'),
('96ada8d4-6c20-4647-bfa6-a747057b6d6f', 'TIF-1317', 'Sistem Operasi', 1, 2019, 3, 3, 2, 1, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: memahami dasar sistem informasi, peranan informasi dalam\r\nmanagemen.<br></p>', '<ol><li>Konsep Dasar Sistem, Data dan Informasi</li><li>Pengenalan Sistem Informasi Manajemen</li><li>Konsep Dasar Kebutuhan Sistem Informasi</li><li>Konsep Dasar Arsitektur Sistem Informasi</li><li>Konsep Dasar Proses Bisnis</li><li>Analisis Sistem Bisnis</li><li>Konsep Dasar Aktifitas Bisnis dari Suatu Organisasi</li><li>Pengenalan Knowledge Management System</li><li>Pengenalan Database Management System</li><li>Pemodelan Proses Perangkat Lunak </li><li>Pemodelan Sistem </li><li>Data Warehouse\r\nData Mining</li></ol>', '<ol><li>Tata Sutabri (Konsep Sistem Informasi)</li><li>Tata Sutabri (Analisis Sistem Informasi)</li><li>Hanif Al Fatta (Analisis dan Perancangan Sistem Informasi)</li><li>Elisabet Yunaeti Anggraeni dan Rita Irviani (Pengantar Sistem Informasi)</li><li>Rosa Ariani Sukamto (Rekayasa Perangkat Lunak (Terstruktur dan Berorientasi objek)<br></li></ol>', '2022-07-01 18:41:00', '2022-07-01 18:41:00'),
('96adaa68-8eb9-4139-bfed-ef134ae4b79e', 'PNK-0201', 'Pendidikan Agama', 2, 2019, 2, 1, 2, NULL, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: Mengembangkan potensi keimanan, ketakwaan, dan akhlak mulia\r\nmahasiswa, dengan menjadikan ajaran Islam sebagai landasan berpikir dan berperilaku dalam pengembangan keilmuan, profesi,\r\nkehidupan berbangsa, bernegara, dan bermasyarakat dalam kerangka Negara Kesatuan Republik Indonesia (NKRI)<br></p>', '<p>Mengapa dan Bagaimana PAI diajarkan di Perguruan Tinggi; Bagaimana Manusia Bertuhan; Bagaimana Agama Menjamin\r\nKebahagiaan; Bagaimana Mengintegrasikan Iman, Islam, dan Ihsan dalam Membentuk Insan Kamil; Bagaimana Membangun\r\nParadigma Qurani untuk Kehidupan Modern; Bagaimana Membumikan Islam di Indonesia; Bagaimana Islam Membangun Persatuan\r\ndalam Keberagaman; Bagaimana Kontribusi Islam dalam Pengembangan Peradaban Dunia; Bagaimana Islam Menghadapi\r\nTantangan Modernisasi; Bagaimana Fungsi dan Peran Masjid Kampus dalam Pengembangan Budaya Islam; Bagaimanakah\r\nPandangan Islam tentang Zakat dan Pajak.<br></p>', '<ol><li>A. Djazuli, Kaidah-Kaidah Fiqih</li><li>Abuddin Nata, Akhlak Tasawuf </li><li>Abuddin Nata, Metode Studi Islam</li><li>Atang Abd. Hakim dan Jaih Mubarok, Metodologi Studi Islam</li><li>Harun Nasution, Islam ditinjau dari Berbagai Aspeknya</li><li>Jaih Mubarok, Sejarah Peradaban Islam</li><li>Manna Khalil al-Khattan, Mahabits fi Ulumul Quran</li><li>Miftah Faridl, Pokok-Pokok Ajaran Islam</li><li>Muhammad Alim, Pendidikan Agama Islam: Upaya Pembentukan Pemikiran dan Kepribadian Islam</li><li>Subhi As-Shalih, Membahas Ilmu-Ilmu Hadits</li><li>Supiana &amp; Karman, Materi Pendidikan Agama Islam<br></li></ol>', '2022-07-01 18:45:24', '2022-07-01 18:45:24'),
('96adaa70-0019-4162-a0cd-b6968387e992', 'PNK-0202', 'Bahasa Indonesia', 2, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat memiliki pengetahuan dan kemampuan menerapkan kaidah-kaidah\r\nberbahasa Indonesia secara baik dan benar serta mampu menerapkannya dalam kegiatan menulis dan berbicara (untuk keperluan\r\nakademik)<br></p>', '<p><b>Kedudukan, Fungsi dan Ragam Bahasa Indonesia</b>: Sejarah, Kedudukan dan Fungsi Bahasa Indonesia dan Ragam Bahasa\r\nIndonesia\r\n</p><p><b>Menulis</b>: Makalah Dan Laporan, Proposal, Kutipan dan Rujukan, dan Daftar Pustaka\r\n</p><p><b>Membaca untuk menulis</b>: Membaca Tulisan/Artikel Ilmiah dan Mengakses Informasi Melalui Internet\r\n</p><p><b>Berbicara untuk keperluan akademik</b>: presentasi ilmiah<br></p>', '<ol><li>Akhadiah, Sabarti, Maidar G. Arsjad, Sakura H. Ridwan. 2003. Pembinaan Kemampuan Menulis Bahasa Indonesia. Jakarta:\r\nErlangga.</li><li>Alwi, Hasan, dkk. 2003. Tata Bahasa Baku Bahasa Indonesia. Jakarta: PT Balai Pustaka.</li><li>Departemen Pendidikan Nasional (2008). Kamus Besar Bahas Indonesia. Jakarta: PT Gramedia Pustaka Utama.</li><li>Hs, Widjono. 2007. Bahasa Indonesia: Mata Kuliah Pengembangan Kepribadian di Perguruan Tinggi. Jakarta: Grasindo.</li><li>Nashuca, Yakub, Muhammad Rohmad, Agus Budi Wahyudi. 2010. Bahasa Indonesia untuk Penulisan Karya Tulis Ilmiah: Mata\r\nKuliah Kepribadian. Yogyakarta: Media Perkasa.</li><li>Pusat Pembinaan dan Pengembangan Bahasa Depdiknas. 2004. Pedoman Umum Ejaan Bahasa Indonesia yang\r\nDisempurnakan &amp; Pedoman Umum Pembentukan Istilah. Bandung: CV. Yrama Widya.</li><li>Pusat Bahasa Depdiknas. 2003. Pengindonesiaan Kata dan Ungkapan Asing. Jakarta: Departemen Pendidikan Nasional.</li><li>Pusat Bahasa Depdiknas. 2003. Buku Praktis Bahasa Indonesia. Jakarta: Departemen Pendidikan Nasional.</li><li>Solihin, Hudori K. A., dan Embay Sa’adiah. 2003. Terampil Berbahasa untuk Perguruan Tinggi. Jakarta: Uhamka.<br></li></ol>', '2022-07-01 18:45:29', '2022-07-01 18:45:29'),
('96adaa78-31df-422a-ac71-da2d80b81d43', 'TIF-2218', 'Logika Informatika', 2, 2019, 2, 1, 2, NULL, '<p>Mahasiswa dapat menganalisa permasalahan dan membuat solusi pemecahan masalah dengan menggunakan algoritma secara\r\nterstruktur menggunakan flowchart dan pseudocode.&nbsp;<br></p>', '<p>1. Dasar-dasar Logika Informatika</p><ul><li><span style=\"font-size: 1rem;\">&nbsp;Proposisi</span></li><li><span style=\"font-size: 1rem;\">Notasi</span></li><li><span style=\"font-size: 1rem;\">Aturan Semantik\r\n</span></li></ul><p><span style=\"font-size: 1rem;\">2. Logika Predikat</span></p><ul><li><span style=\"font-size: 1rem;\">Interpretasi</span></li><li><span style=\"font-size: 1rem;\">Domain</span></li><li><span style=\"font-size: 1rem;\">Quantifier\r\n</span></li></ul><p><span style=\"font-size: 1rem;\">3. Logika Kombinasional\r\n</span></p><p><span style=\"font-size: 1rem;\">4. Logika Biner</span></p><ul><li><span style=\"font-size: 1rem;\">Aljabar</span></li><li><span style=\"font-size: 1rem;\">Boolean </span></li><li><span style=\"font-size: 1rem;\">Fungsi-fungsi Boolean</span></li><li><span style=\"font-size: 1rem;\">Manipulasi Aljabar</span></li><li><span style=\"font-size: 1rem;\">Manipulasi dengan Map</span></li></ul>', '<ol><li>Sismoro, Heri. (2005). Pengantar Logika Informatika. Algoritma dan Pemrograman Komputer Edisi 1. Yogyakarta: Andi.</li><li>Suprapto. (2003). Logika Informatika (Dasar-dasar Logika untuk Pemrograman Komputer &amp; Perancangan Komputer).\r\nYogyakarta: Gava Media.<br></li></ol>', '2022-07-01 18:45:35', '2022-07-01 18:45:35'),
('96adaa80-60ed-48dd-b1a1-15d57fb444ca', 'TIF-2219', 'Bahasa Inggris 2', 2, 2019, 2, 3, 1, 1, '<p>Setelah mengikuti perkuliahan ini, mahasiswa diharapkan mampu menggunakan Bahasa Inggris baik secara lisan maupun tulisan\r\nterkait beberapa pembahasan seperti jobs in ICT, expressions of asking, giving, and declining appoinments, passive voice,\r\ncomparison, making and presenting charts/graphs, doing mini survey, writing CV and job application letter, serta tentang some FAQ\r\nin job interview<br></p>', '<p>1. Jobs in ICT</p><ul><li>Personal qualification or ability</li><li>Job advertisements\r\n</li></ul><p>2. Expressions of making, receiving, and declining appointments\r\n</p><p>3. Passive voice\r\n</p><p>4. Positif, comparatif, and superlatif degree\r\n</p><p>5. Making and presenting charts\r\n</p><p>6. Doing a mini survey\r\n</p><p>7. Writing Curriculum Vitae (CV)\r\n</p><p>8. Writing job application letter\r\n</p><p>9. Some frequently asked questions in job interview<br></p>', '<p>1. Azar, Betty Schrampfer. 1992. Fundamentals of English Grammar, Second Edition. New Jersey: Prentice Hall Regents.\r\n</p><p>2. Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University Press\r\n</p><p>3. Glendinning, Eric H. and McEwan, John. 2002a. Basic English for Computing. Oxford: Oxford University Press<br></p>', '2022-07-01 18:45:40', '2022-07-01 18:45:40'),
('96adaa86-9e92-4785-a640-08d7d5fab2a5', 'TIF-2220', 'Metode Numerik', 2, 2019, 2, 3, 1, 1, '<p>Mahasiswa diharapkan mampu menggukan berbagai alternatif penyelesaian masalah matematika secara numerik, berlatih, perpikir\r\nsecara sistematis dan algoritmik melalui penyelesaian masalah untuk menarik suatu kesimpulan dan dapat mengembangkan\r\npengalaman dalam menerapkan metode numerik dengan menggunakan komputer<br></p>', '<p>1. Pengantar Komputasi Numerik\r\n</p><p>2. Penyelesaian Persamaan Tak Linier</p><ul><li>Metode Terbuka</li><li>Metode Tertutup\r\n</li></ul><p>3. Penyelesaian Sistem Persamaan</p><ul><li>Metode eliminasi Gauss</li><li>Metode eliminasi Gauss Jordan</li><li>Metode Iterasi Gauss-Seidel\r\n</li></ul><p>4. Interpolasi (Interpolasi Linier dan Kuadrat)\r\n</p><p>5. Diferensial dan Integral Numerik&nbsp;<br></p>', '<ol><li>Munir, Rinaldi. (2013). Metode Numerik Revisi Ketiga. Bandung: Informatika.</li><li>Rahmat, Cahya dkk. (2016). Metode Numerik. Malang: POLINEMA PRESS.<br></li></ol>', '2022-07-01 18:45:44', '2022-07-01 18:45:44'),
('96adaa8d-ce33-4b94-bdae-e76f40a9adb0', 'TIF-2221', 'Sistem Informasi', 2, 2019, 2, 1, 2, NULL, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat: memahami dasar sistem informasi, peranan informasi dalam\r\nmanagemen.<br></p>', '<ol><li>Konsep Dasar Sistem, Data dan Informasi</li><li>Pengenalan Sistem Informasi Manajemen</li><li>Konsep Dasar Kebutuhan Sistem Informasi </li><li>Konsep Dasar Arsitektur Sistem Informasi </li><li>Konsep Dasar Proses Bisnis </li><li>Analisis Sistem Bisnis</li><li>Konsep Dasar Aktifitas Bisnis dari Suatu Organisasi</li><li>Pengenalan Knowledge Management System</li><li>Pengenalan Database Management System</li><li>Pemodelan Proses Perangkat Lunak</li><li>Pemodelan Sistem</li><li>Data Warehouse\r\nData Mining<br></li></ol>', '<ol><li>Tata Sutabri (Konsep Sistem Informasi)</li><li>Tata Sutabri (Analisis Sistem Informasi)</li><li>Hanif Al Fatta (Analisis dan Perancangan Sistem Informasi)</li><li>Elisabet Yunaeti Anggraeni dan Rita Irviani (Pengantar Sistem Informasi)</li><li>Rosa Ariani Sukamto (Rekayasa Perangkat Lunak (Terstruktur dan Berorientasi objek)<br></li></ol>', '2022-07-01 18:45:49', '2022-07-01 18:45:49'),
('96adaa94-7ba9-4b48-8701-d9391ae800d1', 'TIF-2322', 'Desain dan Pemrograman Web 1', 2, 2019, 3, 3, 2, 1, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa diharapkan dapat :\r\n</p><p>1. Memiliki pemahaman yang kritis dan sistematis mengenai karakteristik dan prinsip mengenai desain website yang baik.\r\n</p><p>2. Memahami dan mampu menggunakan bahasa pemrograman yang digunakan dalam pembuatan website.<br></p>', '<p><b>Teori :\r\n</b></p><ol><li>Konsep Dasar Web</li><li>Pengenalan CSS</li><li>Pengenalan Konsep Dasar Client-Server</li><li>Pengenalan Dasar Javascript</li><li>Pengenalan Struktur Web.</li><li>Pengenalan Dasar PHP</li><li>Pengenalan Struktur HTML</li></ol><p><b>Praktikum :</b></p><ol><li>Pengenalan Struktur HTML dan Tag yang digunakan</li><li>Pengenalan dan Penggunaan Syntax Javascript</li><li>Penggunaan Tag HTML pada kasus tertentu</li><li>Pengenalan Framework CSS</li><li>Pengenalan dan Penggunaan Syntax CSS</li></ol><p><b>Framework CSS yang digunakan </b>: Bootstrap, Semantics UI, Foundation&nbsp;<br></p>', '<ol><li><a href=\"https://developer.mozilla.org/id/docs/Web/HTML\" target=\"_blank\">developer.mozilla.org</a></li><li><a href=\"https://developer.mozilla.org/en-US/docs/Web/CSS/Reference\" target=\"_blank\">developer.mozilla.org</a></li><li><a href=\"https://developer.mozilla.org/id/docs/Web/JavaScript\" target=\"_blank\">developer.mozilla.org</a></li><li><a href=\"https://www.w3schools.com/html/default.asp\" target=\"_blank\">w3schools.com</a></li><li><a href=\"https://www.w3schools.com/css/default.asp\" target=\"_blank\">w3schools.com</a></li><li><a href=\"https://www.w3schools.com/js/default.asp\" target=\"_blank\">w3schools.com</a></li><li>https://www.w3schools.com/php/default.asp</li><li>https://getbootstrap.com/<br></li></ol>', '2022-07-01 18:45:53', '2022-07-01 18:45:53'),
('96adaa9a-e414-4e3c-800a-fecb24804b8b', 'TIF-2323', 'Basis Data', 2, 2019, 3, 3, 2, 1, '<p>Mahasiswa mampu melakukan analisis, desain, dan implementasi basis data dan menerapkan pemrograman basis data untuk\r\nmenghasilkan aplikasi.&nbsp;<br></p>', '<p><b>Teori :</b></p><ol><li>Query (View)</li><li>Pengenalan Aljabar Relasional &amp; Kalkulus Relasional</li><li>Keamanan Sistem Basis Data</li><li>Pengenalan Objek Sistem Manajemen Basis Data</li><li>Transaksi Konkurensi Dalam Basisdata</li><li>Store Procedure</li><li>Triger\r\n</li></ol><p><b>Praktikum </b>:\r\nMelakukan Rekayasa Sistem Basis Data Sesuai Materi Basis Data<br></p>', '<ol><li>Silberschatz A., Korth HF., Sudarshan S. 2014. Database System Concept. Foxit Software Company.</li><li>Fathansyah. 2018. Basis Data Revisi Ketiga. Bandung: Informatika.</li><li>Abdul Kadir, Konsep dan Tuntunan Praktis Basis Data. Yogyakarta: Andi.</li><li>Manual MySql, MsSql<br></li></ol>', '2022-07-01 18:45:57', '2022-07-01 18:45:57'),
('96adaab9-23ad-4cbd-a1c7-a8413293ad94', 'TIF-2324', 'Multimedia', 2, 2019, 3, 3, 2, 1, '<p>Melalui matakuliah ini mahasiswa dapat memahami konsep pembuatan produk multimedia dan mampu menghasilkan sebuah produk\r\nmultimedia digital serta mengikuti perkembangan teknologi multimedia.&nbsp;<br></p>', '<p><b>Teori :</b>&nbsp;</p><p>1. Pengenalan Multimedia Digital</p><ul><li>Elemen Multimedia</li><li>Multimedia Presentation\r\n</li></ul><p>2. Pengenalan Produk Multimedia\r\n</p><p>3. Produksi Konten Multimedia\r\n</p><p>4. Pengenalan Perangkat Lunak Multimedia\r\n</p><p>5. Perkembangan Teknologi Multimedia\r\n</p><p><b>Praktikum</b> :\r\nPembuatan Produk Multimedia<br></p>', '<p>1.Li, Ze-Nian dan Drew, Mark S. (2004). Fundamentals of Multimedia. New Jersey: Pearson Education.\r\n</p><p>2. Binanto, Iwan. (2010). Multimedia Digital. Yogyakarta: Penerbit Andi.\r\n</p><p>3. Steinmetz, R dan Klara Nahrstedt. (2004). Multimedia Applications. Jerman: Springer.\r\n</p><p>4. Clark, Nathan. (2018). UI/UX Design Basics and Fundamentals. Amazon Digital Services.\r\n</p><p>5. Youtube channel: Belajar CorelDraw Indonesia, Adobe PremierePro, dll.<br></p>', '2022-07-01 18:46:17', '2022-07-01 18:46:17'),
('96adaba2-9a5c-4529-a4f9-8f5782133b16', 'TIF-3325', 'Pemrograman Berorientasi Objek', 3, 2019, 3, 3, 2, 1, '<p>Kuliah ini mengajarkan konsep pemrograman berorientasi obyek disertai contoh penerapan konsep pemrograman berorientasi\r\nobyek pada bahasa pemrograman. Pada kuliah ini mahasiswa diharapkan dapat merancang dan mengimplementasikan\r\npermasalahan ke dalam konsep pemrograman berorientasi obyek dengan diberikan tugas-tugas pemrograman dan tugas proyek.<br></p>', '<p><b>Teori :</b>\r\n</p><ol><li>1. Konsep Pemrograman Berorientasi Objek</li><li> Pondasi Pemrograman Berorientasi Objek </li><li>Analsis dan Desain Berorientasi Objek </li><li>Class and Method</li><li>Instance Object </li><li>Abstraction, Inheritance</li><li>Encapsulation</li><li>Polymorphism</li><li>Data Collection </li><li>Class Relationship</li></ol><p><b> Praktikum </b>:\r\nImplementasi OOP dalam Bahasa Pemrograman<br></p>', '<ol><li>Hadaya, KH., 2015, Java dektop dengan metode Pro-OOP, ANDI PUBLISHER, Andi</li><li>Timothy C. Lethbridge and Robert Laganière. Object-Oriented Software Engineering: Practical Software Development\r\nusing UML and Java Second Edition.<br></li></ol>', '2022-07-01 18:48:50', '2022-07-01 18:48:50'),
('96adaba8-88ff-4ffb-a8d6-2c0d79388efd', 'TIF-3326', 'Desain dan Pemrograman Web 2', 3, 2019, 3, 3, 2, 1, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa diharapkan dapat :</p><ol><li>Memahami dan mampu menggunakan teknolgi yang berkembang dalam pembuatan websit</li><li>Memahami dan mampu menggunakan framework dalam pengembangan website</li><li>Memahami dan mampu menggunakan Service Based API dalam mendukung aplikasi</li></ol>', '<p><b>Teori :</b></p><ol><li>Pengenalan Konsep MVC</li><li>Pengenalan Struktur MVC</li><li>Pengenalan Framework PHP</li><li>Pengenalan Framework Javascript</li><li>Pengenalan Web API, AJAX dan REST<br></li></ol><p><b>Praktikum :</b></p><ol><li>Pengenalan dan Penggunaan MVC pada Object Oriented PHP</li><li>Pengenalan dan Penggunaan MVC pada Framework PHP</li><li>Pengelolaan Manajemen Data menggunakan Framework PHP</li><li>Penggunaan AJAX</li><li>Pengenalan dan Penggunaan REST Method</li><li>Pengenalan dan Penggunaan Web API</li></ol><p><b>PHP Framework yang digunakan </b>: Laravel, Lumen, Symfony, Yii, CodeIgniter<br></p>', '<ol><li><a href=\"https://getcomposer.org/doc/\" target=\"_blank\">getcomposer.org</a></li><li><a href=\"https://git-scm.com/doc\" target=\"_blank\">git-scm.com</a></li><li><a href=\"https://laravel.com/docs/master\" target=\"_blank\">laravel.com</a></li></ol>', '2022-07-01 18:48:54', '2022-07-01 18:48:54'),
('96adabaf-110f-40ba-b62c-c2cf56228882', 'TIF-3227', 'Mobile Programming 1', 3, 2019, 2, 2, NULL, 2, '<p>Matakuliah ini memberikan pemahaman dan skill kepada mahasiswa untuk mampu membuat aplikasi berbasis android.&nbsp;<br></p>', '<p><b>Praktikum :\r\n</b></p><ol><li>Activities and Intens </li><li>Activity lifecycle and state</li><li>Debugging</li><li>Android Support Library</li><li>UI/UX</li><li>Menus and Navigation</li><li>Assets Management</li><li>Material Design</li><li>Services</li><li>Notifications</li><li>Data Storage<br></li></ol>', '<ol><li><a href=\"https://git-scm.com/doc\" target=\"_blank\">git-scm.com</a></li><li><a href=\"https://developer.android.com/docs?hl=id\" target=\"_blank\">developer.android.com</a></li><li><a href=\"https://material.io/components\" target=\"_blank\">material.io</a></li></ol>', '2022-07-01 18:48:58', '2022-07-01 18:48:58'),
('96adabb5-7543-4eb1-bc6e-f5f45b08542c', 'TIF-3228', 'Konsep Jaringan', 3, 2019, 2, 3, 1, 1, '<p>Mahasiswa memahami dan mampu menjelaskan tentang konsep serta implementasinya dalam perangkat jaringan komputer.\r\nMamasiswa mampu mengelola jaringan LAN dan mengkonfigurasi Server Internet, pengelolaan IP address berbagai kelas dalam\r\njaringan komputer.<br></p>', '<ol><li>Konsep Dasar Jaringan</li><li>Struktur dan Arsitektur Jaringan</li><li>Jaringan Kabel dan Nirkabel</li><li>Pengalamatan Jaringan dengan IP</li><li>Subnetting</li><li>Supernetting</li><li>Routing</li><li>Protokol Jaringan Standar</li><li>Session Layer </li><li>Transpot Layer</li><li>Layer Network</li><li>Phisycal Layer</li><li>Layer Data Link<br></li></ol>', '<ol><li>Cisco Networking Academy Program : Network Fundamental, CCNA Exploration 1.</li><li>Cisco Router, Hendra Wijaya, Elex Media Komputindo, 2004.</li><li>Computer Networks, Prentice Hall, Fourth Eds, 2003.</li><li>Pratama, Eke IPA. Handbook Jaringan Komputer Teori dan Praktik Berbasiskan Opensource. Bandung, Informatika. 2015<br></li></ol>', '2022-07-01 18:49:03', '2022-07-01 18:49:03'),
('96adabbc-72ab-4ddd-a718-4bdad0599a43', 'TIF-3229', 'Interaksi Manusia dan Komputer', 3, 2019, 2, 1, 2, 0, '<p>Memberikan pemahaman teori dan paraktek interaksi manusia dan komputer (IMK) yang meliputi :Konsep IMK, faktor manusia, User\r\nReseach aspek ergonomik, piranti interaktif, ragam dialog, desain input, desain output, dan desain dialog.<br></p>', '<ol><li>Konsep IMK</li><li>Faktor Manusia dalam IMK</li><li>User Reseach (Produc Vision, User Persona, Empathy Map, Journey Map)</li><li>Piranti IMK</li><li>Ragam Dioalog</li><li>Desain Antar Muka</li><li>Graphical User Interface (GUI)</li><li>Komponen Antar Muka Grafis</li><li>Aspek Ergonomik<br></li></ol>', '<ol><li>Ahmad Musyidun Nidhom, S.Pd., M.Pd ( Interkasi Manusia dan Komputer)</li><li>Supriyanta, M.Kom ( Interaksi Manusia dan Komputer)</li><li>Insap Santoso (Interkasi Manusia dan Komputer Edisi 2)<br></li></ol>', '2022-07-01 18:49:07', '2022-07-01 18:49:07'),
('96adabc2-9689-45b9-8d93-71ac756c47c8', 'TIF-3230', 'Rekayasa Perangkat Lunak', 3, 2019, 2, 3, 1, 1, '<p>Mahasiswa mampu memahami pentingnya menerapkan prinsip-prinsip rekayasa perangkat lunak dalam membangun sebuah\r\nperangkat lunak, pengujian serta pemeliharaannya sehingga menghasilkan sebuah produk perangkat lunak yang berkualitas baik (a\r\ngood quality software)&nbsp;<br></p>', '<ol><li>Konsep dasar rekayasa perangkat lunak</li><li>Siklus hidup perangkat lunak</li><li>Jenis-jenis metode pengembangan perangkat lunak</li><li>Programming Vs Developing</li><li>Kriteria “A good quality software”</li><li>Mendefiniskan kebutuhan fungsional dan kebutuhan non-fungsional</li><li>Mendokumentasikan spesifikasi kebutuhan perangkat lunak dan spesifikasi perancangan</li><li>Teknik pengujian perangkat lunak</li><li>Konsep pemeliharaan perangkat lunak<br></li></ol>', '<ol><li>Pressman, R. S. (2010). Software Engineering: A Practitioner’s Approach Edisi ke-7. Mc Graw-Hill.</li><li>Sommervile, Ian. (2001). Software Engineering Edisi ke-6.</li><li>Kendall. (2013). System Analysis and Design.</li><li>Software Engineering Body of Knowledge. (2004).</li><li>Simarmata, Janner. (2010). Rekayasa Perangkat Lunak. Yogyakarta: Penerbit Andi.<br></li></ol>', '2022-07-01 18:49:11', '2022-07-01 18:49:11'),
('96adabc8-ef28-4af2-beba-2f57b2377779', 'TIF-3231', 'Analisa Perancangan Sistem Informasi', 3, 2019, 2, 3, 1, 1, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nMemiliki pemahaman dan keterampilan dalam analisis, pengembangan, pemahaman serta pengembangan sistem informasi.<br></p>', '<p>1. Konsep Dasar Analisis Perancangan Sistem Informasi\r\n</p><p>2. Analisis Sistem</p><ul><li>Analisis Perancangan Input</li><li>Analisis Perancangan Output</li><li>Analisis Perancangan Dialog</li><li>Analisis Perancangan Proses Sistem</li><li>Analisis Perancangan ERD\r\n</li></ul><p>3. Siklus Hidup Pengembangan Sistem Informasi\r\n</p><p>4. Perancangan Sistem Model Terstruktur dan Berorientasi Obyek\r\n</p><p>5. Pengujian, Implementasi dan Pemeliharaan Sistem\r\n</p><p>6. Implementasi dalam Studi Kasus<br></p>', '<ol><li>Muhammad Muslihudin dan Oktafiantro (Analisis dan Perancangan Sistem Informasi) Menggunakan model terstruktur dan UML</li><li>M. Firman Arif, S.Kom., M.Kom (Analisis dan Pracangan Sistem Informasi</li><li>Maniah, S.Kom., M.T dan Dini Hamidin, S.Si., MBA., MT (Analisis dan Perancangan Sistem Informasi)<br></li></ol>', '2022-07-01 18:49:15', '2022-07-01 18:49:15'),
('96adabce-14b5-4aff-a63f-430f5d069aa1', 'TIF-3232', 'Organisasi dan Arsitektur Komputer', 3, 2019, 2, 1, 2, 0, '<p>Melalui mata kuliah mahasiswa diharapkan dapat mengetahui dan memahami evolusi dan kinerja computer dari generasi 1 sampai\r\ndengan 6, struktur interkoneksi komponen computer yang dikenal dengan istilah sistem bus, memori cache, internal dan eksternal\r\nmemori, modul I/O dan CPU sebagai bagian komponen computer, Operating System Support, Computer arithmetic, memahami lebih\r\ndalam mengenai set intruksi seperti fungsi, karakteristik, format dan teknik pengalamatannya.<br></p>', '<ol><li>Perkembangan dan Definisi Komputer</li><li>Sistem Komputer</li><li>CPU</li><li>Main Memory</li><li>Sistem BUS</li><li>I/O Devices </li><li>Aljabar Boolean dan Logika</li><li>Pengenalan Sistem Operasi</li><li>Bahasa Pemrogaman&nbsp;<br></li></ol>', '<ol><li>Computer Organization and Architecture, William Stalling, Fifth Edition, prentice Hall, 2000</li><li>Computer Organization Architecture, Andrew S. Tanenbaum prentice Hall, 1999</li><li>Computer Organization, Hamacher, McGraw Hill, 1990</li><li>Applied Operating System concept, Avi Silberschatz, peter Galvin, Greg Gagne, John Wiley Inc 2000<br></li></ol>', '2022-07-01 18:49:19', '2022-07-01 18:49:19'),
('96adabd4-3b7d-40a2-b67e-a8b886b754f2', 'TIF-3233', 'Techopreneur', 3, 2019, 2, 3, 1, 1, NULL, NULL, NULL, '2022-07-01 18:49:23', '2022-07-01 18:49:23'),
('96adacc1-1472-442a-9d2b-44bf27358bc1', 'PNK-0211', 'Ilmu Sosial Budaya Dasar', 4, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat:\r\nmenjadi ilmuwan dan profesional yang berpikir kritis, kreatif, sistematik dan ilmiah, berwawasan luas, etis, memiliki kepekaan dan\r\nempati sosial, bersikap demokratis, berkeadaban, serta dapat ikut berperan mencari solusi pemecahan masalah sosial dan budaya\r\nsecara arif.<br></p>', '<ol><li>Pengantar ISBD</li><li>Manusia Sebagai Makhluk Budaya</li><li>Manusia Sebagai Makhluk Individu dan Sosial</li><li>Manusia dan Peradaban</li><li>Manusia, Keragaman, dan Kesetaraan</li><li>Manusia, Nilai, Moral, dan Hukum</li><li>Manusia, Sains, Teknologi dan Seni</li><li>Manusia dan Lingkungan&nbsp;<br></li></ol>', '<ol><li>Herimanto dan Winarno. Ilmu Sosial Budaya Dasar. Bumi Aksara. 2013</li><li>Sarinah. Ilmu Sosial Budaya Dasar (di Perguruan Tingi)</li><li>Lies Sudibyo, dkk. Ilmu Sosial Budaya Dasar. Andi Publisher. 2013.<br></li></ol>', '2022-07-01 18:51:58', '2022-07-01 18:51:58'),
('96adacc7-8d52-47a7-8be7-2542399cc631', 'TIF-4234', 'Bahasa Inggris 3', 4, 2019, 2, 3, 1, 1, '<p>Setelah mengikuti perkuliahan ini, mahasiswa diharapkan mampu menggunakan bahasa Inggris baik secara lisan maupun tulisan\r\ndalam pembahasan tentang Basic element in computer system, current technologyMost frequently asked questions about\r\nnetworking, cybercrime, designing cybercafe, translating abstract, TOEFL Preparation<br></p>', '<ol><li>Basic element in computer system</li><li>Current technology</li><li>Most frequently asked questions about networking</li><li>Cybercrime :Analyzing Problems and Providing Solutions and Preventions </li><li>Designing cybercafe</li><li>Translating abstract </li><li>TOEFL Preparation: Tips and tricks<br></li></ol>', '<ol><li>Demetriades, Dinos. 2008. Information Technology Workshop. Oxford: Oxford University Press.</li><li>Esteras, Santiago Remacha. 2007. Infotech English for Computer Users: Fourth Edition. Cambridge: Cambridge University Press</li><li>Olejniczak, Maja. 2011. English for Information Technology 1. Essex: Pearson Education Limited.</li><li>Sumber internet lainnya<br></li></ol>', '2022-07-01 18:52:02', '2022-07-01 18:52:02'),
('96adaccf-496c-4819-9265-272d2fdab52d', 'TIF-4235', 'Jaringan Tingkat Lanjut', 4, 2019, 2, 3, 1, 1, NULL, NULL, NULL, '2022-07-01 18:52:07', '2022-07-01 18:52:07'),
('96adacea-5591-42b5-8ea0-d11ab325ffa0', 'TIF-4236', 'Manajemen Proyek', 4, 2019, 2, 1, 2, NULL, '<p>Setelah mengikuti mata kuliah ini, mahasiswa diharapkan dapat memahami dan menumbuhkan pengetahuan mengenai fungsi\r\nmanajemen, khususnya dalam proyek teknologi informasi, mulai tahap inisiasi, perencanaan, pelaksanaan, pengendalian, dan\r\npengakhiran, serta dapat memanfaatkan tool dan teknik yang terdapat dalam bidang manajemen proyek. Dengan pemahaman dan\r\nketerampilan tersebut diharapkan dapat memanfaatkan dan mengembangkan teknik-teknik manajemen sehingga dapat menjadi\r\nlandasan dalam perancangan dan pengembangan sistem informasi.<br></p>', '<ol><li>Pengantar Manajemen Proyek</li><li>Konteks dan Proses Dalam Manajemen Proyek</li><li>Manajemen Integrasi Proyek/Project Integration</li><li>Manajemen Ruang Lingkup Proyek/Project Scope</li><li>Manajemen Waktu Proyek/Project Time Management</li><li>Manajemen Biaya Proyek/Project Cost Management</li><li>Manajemen Kualitas Proyek/Project Quality Management</li><li>Manajemen SDM/ Project Human Resource Management</li><li>Manajemen Komunikasi Dalam Proyek/Project Communication Management</li><li>Manajemen Risiko Dalam Proyek/Project Risk Management</li><li>Manajemen Pengadaan Proyek/Project Procurement Management</li><li>Inisiasi, Perencanaan, dan Eksekusi Proyek</li><li>Pengontrolan Aktivitas Proyek</li><li>Pengakhiran Proyek/Project Closing&nbsp;<br></li></ol>', '<ol><li>Iman Soeharto. Manajemen Proyek: dari konseptual sampai operasional. Jakarta: Erlangga. 1999.</li><li>Project Management Institute. A Guide to the Project Management Body of Knowledge: PMBOK Guide Edition 5, PMI, , 2013</li><li>Kathy Schwalbe. Information Technology Project Management. Cengage Learning. 2016.</li><li>Rudy Tantra. Manajemen Proyek Sistem Informasi. Andi Offset. 2012.</li><li>Poject Management Isntitute. PMBoK 6th Guide Edition in Bahasa Indonesia/Pedoman Kerangka Ilmu Manajemen Proyek: Edisi\r\nKeenam. PMI.<br></li></ol>', '2022-07-01 18:52:25', '2022-07-01 18:52:25'),
('96adacf1-5bb0-40e2-912a-a8814a98092f', 'TIF-4237', 'Sistem Pendukung Keputusan', 4, 2019, 2, 1, 2, 0, '<p>Mahasiswa mengerti dan mampu menerapkan konsep pengambilan keputusan dalam organisasi memanfaatkan sistem berbasis\r\nkomputer untuk mendukung pengambilan keputusan.<br></p>', '<ol><li>Proses pengambilan keputusan (Proses pengambilan keputusan, jenis permasalahan dalam model keputusan, Tahapan\r\nPengambilan Keputusan, LKlasifikasi Pengambilan Keputusan, Klasifikasi Pengambilan Keputusan, Klasifikasi Model Data,\r\nKlasifikasi Solusi,Multicriteria decision making) (MCDM), (Multi Objective Decision Making (MODM)</li><li>Sistem pendukung keputusan (Menjelaskan Tahapan Pengembangan SPK)</li><li>Metode Pembobotan</li><li>SAW</li><li>AHP</li><li>TOPSIS</li><li>VIKOR</li><li>ELECTRE</li><li>FUZZY&nbsp;<br></li></ol>', '<ol><li>Dicky Nofriansyah, S.Kom.,M.Kom (Konsep Data Mining Vs Sistem Pendukung Keputusan)</li><li>Diana, S.Si.m M.Kom ( Metode dan Aplikasi Sistem Pendukung Keputusan)</li><li>Irfan Subakti, Sistem Pendukung Keputusan (Decision Support System), ITS, Surabaya, 2002.</li><li>Yayasan Kita Menulis (Sistem Pendukung Keputusan metode dan implementasi)<br></li></ol>', '2022-07-01 18:52:30', '2022-07-01 18:52:30'),
('96adacf8-f2c6-490a-8f3c-f6752c5d8939', 'TIF-4238', 'Keamanan Komputer', 4, 2019, 2, 3, 1, 1, '<p>Mahasiswa mampu memahami, mengonfigurasi, dan menguji penerapan keamanan jaringan.<br></p>', '<p>1. Pengantar Keamanan Jaringan\r\n</p><p>2. Model Keamanan Jaringan\r\n</p><p>3. Analisa Serangan dan Cara Menaggulanginya (Proteksi dan Pemulihan)</p><ul><li>Authentication</li><li>Scripting Injection</li><li>Authorization</li><li>Teknik Pemulihan\r\n</li></ul><p>4. Kriptografi, Enkripsi dan Dekripsi Konvensional\r\n</p><p>5. Kunci Simetris dan Asimetris\r\n</p><p>6. Algoritma Hash\r\n</p><p>7. Infrastruktur Kunci Publik\r\n</p><p>8. Ethical Hacking<br></p>', '<ol><li>Angus Wong and Alan Yeung, “Network Infrastructure Security’, Springer, 2009.</li><li>“Definitions: IT Security Architecture”, SecurityArchitecture.org, Jan, 2008.</li><li>“New hacking technique exploits common programming error”. SearchSecurity.com, July 2007.</li><li>E. Stewart Lee “Essays about Computer Security”, Cambridge, 1999.</li><li>Morrie Gasser, “Building a secure computer system “, ISBN 0-442-23022-2 1988.</li><li>Pratama, Eke IPA. Handbook Jaringan Komputer Teori dan Praktik Berbasiskan Opensource. Bandung, Informatika. 2015</li><li>Purbo, Ono W. Keamanan Jaringan.</li><li>Stiawan, Deris. Sistem Keamanan computer, 2005.<br></li></ol>', '2022-07-01 18:52:35', '2022-07-01 18:52:35'),
('96adacff-a487-4548-8efd-682c6af70201', 'TIF-4239', 'Kecerdasan Buatan', 4, 2019, 2, 1, 2, 0, '<ol><li>Mahasiswa mengerti konsep dasar sistem cerdas: fuzzy logic, neural network dan algoritma genetika.</li><li>Mahasiswa mengerti dan mampu menerapkan sistem cerdas dalam aplikasi sederhana.<br></li></ol>', '<ol><li>Pengantar Kecerdasan Buatan,</li><li>Sistem Pakar</li><li>Case Based Reasoning</li><li>Rule Based Reasoning</li><li>Jaringan Syaraf Tiruan</li><li>Logika Fuzzy</li><li>Algoritma Genetika<br></li></ol>', '<ol><li>Sri Kusumadewi, 2004, Aplikasi Logika Fuzzy Untuk Pendukung Keputusan, Graha Ilmu, Yogyakarta.</li><li>Son Kuswadi, 2000, Kendali Cerdas, DiktatKuliah Politeknik ITS, Surabaya</li><li>Arief Hermawan,2006, Jaringan Syaraf Tiruan Teori dan Aplikasi, Penerbit Andi, Yogyakarta.</li><li>Suyanto, 2005, Algoritma Genetika dalam Matlab, Penerbit Andi, Yogyakarta.</li><li>Sri Kusumadewi, 2002, Analisis dan Desain Sistem Fuzzy Menggunakan Toolbox Matlab, Graha Ilmu, Yogyakarta.<br></li></ol>', '2022-07-01 18:52:39', '2022-07-01 18:52:39'),
('96adad05-c580-4473-b498-7756c1ec9f08', 'TIF-4240', 'Aplikasi dan Teknologi Web', 4, 2019, 2, 2, 0, 2, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa diharapkan dapat :</p><ol><li>Memahami dan mampu menggunakan teknologi yang berkembang dalam pembuatan website</li><li>Memahami dan mampu menggunakan framework dalam pengembangan website<br></li></ol>', '<p><b>Praktikum :</b></p><ol><li>Version Control</li><li>Design Patern</li><li>Package Manager</li><li>CSS Preprocessor</li><li>Build Tools</li><li>Web Components</li><li>Progressive Web App</li><li>Trusted Web Activities</li><li>Server Side Rendering<br></li></ol>', '<ol><li><a href=\"https://javascript.info/\" target=\"_blank\">javascript.info</a></li><li><a href=\"https://nodejs.org/en/docs/\" target=\"_blank\">nodejs.org</a></li></ol>', '2022-07-01 18:52:43', '2022-07-01 18:52:43'),
('96adad0a-b0d7-4ead-9ce4-3fe8ef72a841', 'TIF-4241', 'Metodologi Penelitian', 4, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini mahasiswa akan dapat merancang kebutuhan-kebutuhan dalam melakukan sebuah penelitian&nbsp;<br></p>', '<ol><li>Konsep Dasar Penelitian</li><li>Prinsip-Prinsip Penelitian</li><li>Motodologi dalam Penelitian</li><li>Alur Penyusunan Proposal Penelitian</li><li>Alur Penyusunan Tugas Akhir</li><li>Aturan Dalam Penulisan Laporan Tugas</li><li>Eknik Presentasi Hasil Penelitian<br></li></ol>', '<ol><li>Teknik Penulisan Laporan Ilmiah, ITB</li><li>Metodologi Penelitian untuk Insinyur, Prof. DR. Ir. Faraz Umar</li><li>Handbook of Research Method Muhammad cs., Metodologi Penelitian Teknologi</li><li>Leedy, Paul D, Practical Research: Planning and Design, McMillan 1974</li><li>Zainal A. Hasibuan Phd, Metodologi penelitian pada bidang ilmu komputer dan teknologi informasi, 2007, fakultas ilmu\r\nkomputer, universitas Indonesia<br></li></ol>', '2022-07-01 18:52:46', '2022-07-01 18:52:46'),
('96adad10-1024-40cc-83b3-3d452d496e32', 'TIF-4342', 'Proyek 1', 4, 2019, 3, 2, 0, 3, '<p>Mahasiswa mampu merancang sistem informasi sesuai dengan studi kasus yang dipilih<br></p>', '<p><b>Praktikum </b>:</p><ol><li>Pengajuan dan Verifikasi Judul Penelitian</li><li>Bimbingan Penyusunan Laporan Penelitian</li><li>Pendaftaran Seminar Penelitian</li><li>Pelaksanaan Seminar Penelitian</li><li>Revisi Laporan Penelitian Pasca Seminar</li><li>Pengumpulan Hasil Penelitian<br></li></ol>', '<ol><li>Buku Panduan Penulisan Proyek 1 Program Studi Teknik Informatika Politeknik Negeri Ketapang<br></li></ol>', '2022-07-01 18:52:50', '2022-07-01 18:52:50'),
('96adae88-b859-4f0f-8960-286240602017', 'PNK-0210', 'Ilmu Alamiah Dasar', 5, 2019, 2, 1, 2, 0, '<p>Setelah mengikuti mata kuliah ini mahasiswa diharapkan menjadi ilmuwan dan professional yang berpikir kritis, kreatif, sistemik dan\r\nilmiah, berwawasan luas; etis, estetis serta memiliki kepedulian terhadap pelestarian sumberdaya alam dan lingkungan hidup, serta\r\nmempunyai wawasan tentang perkembangan ilmu pengetahuan, dan teknologi serta dapat ikut berperan mencari solusi pemecahan\r\nmasalah lingkungan hidup secara arif.<br></p>', '<ol><li>Pengantar IAD</li><li>Alam Pikiran Manusia dan Perkembangannya</li><li>Perkembangan dan Pengembangan Ilmu Pengetahuan Alam</li><li>Bumi dalam Alam Semesta</li><li>Keanekaragaman Makhluk Hidup dan Persebarannya</li><li>Makhluk Hidup dalam Ekosistem Alami</li><li>Sumberdaya Alam dan Lingkungan</li><li>Ilmu Pengetahuan Alam dan Teknologi bagi Kehidupan Manusia</li><li>Beberapa Perkembangan Teknologi Penting</li><li>Isu Lingkungan<br></li></ol>', '<ol><li>Nelly Wedyawati. Ilmu Alamiah Dasar. Nanga Pinoh: Sekolah Tinggi Keguruan dan Ilmu Pendidikan Melawi. 2010.</li><li>Sudjatinah. Ilmu Kealaman Dasar. Semarang University Press. 2010.</li><li>Ati Harmoni. Pengantar Ilmu Alamiah Dasar. Depok: Penerbit Gunadarma. 1992.</li><li>Mawardi &amp; Nur Hidayati. Ilmu Alamiah Dasar, Ilmu Sosial Dasar, Ilmu Budaya Dasar. Penerbit : Pustaka Setia</li><li>Herabudin. Ilmu Alamiah Dasar (IAD). Pustaka Setia. 2013<br></li></ol>', '2022-07-01 18:56:57', '2022-07-01 18:56:57'),
('96adae8f-c915-4a5d-8ba3-91b18597ce13', 'TIF-5346', 'Data Mining', 5, 2019, 3, 3, 2, 1, '<ol><li>Mahasiswa mampu menjelaskan pengertian tentang konsep-konsep fundamental yang berkaitan dengan penggunaan dan\r\nimplementasi data mining</li><li>Mahasisswa mampu mendesain dan mengimplementasikan data mining sesuai dengan kebutuhan pengguna dimana data\r\nmining merupakan bagian yang tidak terpisahkan dari sebuah system.<br></li></ol>', '<p><b>Teori :</b></p><ol><li>Pengenalan Data Mining</li><li>Pengenalan Data Warehouse</li><li>Pengenalan Algoritma Data Mining</li><li>Pengenalan Teknik Data Mining (Asosiasi, Klasifikasi, dan Klastering)</li><li>Knowledge Discovery in Database (KDD)</li><li>Pengenalan Software Data Mining</li></ol><p><b>Praktikum :&nbsp;<br></b></p><ol><li>Data Cleansing </li><li>Data Processing<br></li></ol>', '<ol><li>Efori Buulolo, S.Kom., M.Kom (Data Mining untuk PT)</li><li>Kusrini, Emha Taufiq Luthfi (Algoritma Data Mining)</li><li>Miftahun Huda, M.Kom (Algoritma Data Mining Anlisis data dengan Komputer)<br></li></ol>', '2022-07-01 18:57:01', '2022-07-01 18:57:01'),
('96adae95-83ff-48f8-a856-038cafac487d', 'TIF-5243', 'Keterampilan Komunikasi', 5, 2019, 2, 3, 1, 1, '<ol><li>Mahasiswa mampu memahami teori dan prinsip komunikasi serta mampu menelaah masalah-masalah yang terjadi dalam\r\nkomunikasi di tempat kerja</li><li>Memiliki pengetahuan dan keterampilan<br></li></ol>', '<ol><li>Pengertian dan Teori Komunikasi</li><li>Hubungan Antara Komunikasi Dengan Kinerja</li><li>Aliran Informasi</li><li>Media Komunikasi </li><li>Teknologi Komunikasi</li><li>Aspek Etika Komunikasi</li><li>Literasi Digita<br></li></ol>', '<ol><li>Imam Soeharto. Manajemen Proyek: dari konseptual sampai operasional. Jakarta: Erlangga. 1999.</li><li>Project Management Institute. A Guide to the Project Management Body of Knowledge: PMBOK Guide Edition 5, PMI, , 2013.</li><li>Deddy Mulyana. Pengantar Ilmu Komunikasi: Suatu Pengantar. Bandung: Rosda. 2017.</li><li>Arni Muhammad. Komunikasi Organisasi. Bumi Aksara. </li><li>Hafied Cangara. Pengantar Ilmu Komunikasi. Rajawali Pers. 2010. </li><li>Suryanto. Pengantar Ilmu Komunikasi. Pustaka Setia. 2017</li><li>Onong Uchyana Effendy. Ilmu Komunikasi: Teori dan Praktek. Remaja Rosdakarya. 2007.<br></li></ol>', '2022-07-01 18:57:05', '2022-07-01 18:57:05'),
('96adae9c-3272-424b-9119-2051aa944480', 'TIF-5344', 'Teknologi Komunikasi', 5, 2019, 3, 3, 2, 1, '<ol><li>Memahami prinsip kerja sistem komunikasi nirkabel.</li><li>Memahami karakteristik komunikasi nirkabel dan Transmisi Komunikasi Nirkabel pek propagasi, redaman dan sistem modulasi\r\npada komunikasi nirkabel. </li><li>Memahami jaringan pada sistem komunikasi nirkabel.</li><li>Memanfaatkan teknologi-teknologi pada sistem komunikasi nirkabel<br></li></ol>', '<ol><li>Pengenalan Sistem Komunikasi Nirkabel</li><li>Transmisi Komunikasi Nirkabel : Konsep Frekuensi, Sinyal, Antena dan Propagasi, Redaman, Konsep Multiplexing, Modulasi\r\nDigital.</li><li>Sistem komunikasi bergerak : GSM,UMTS &amp; CDMA</li><li>Jaringan IEEE 802.11 dan Implementasinya : Jaringan Wireless LAN, Wireless Security</li><li>Desain Jaringan Wireless LAN : Point-to-Point dan Point-to-Multipoint Wireless Network</li><li>Studi kasus perencanaan jaringan nirkabel.<br></li></ol>', '<ol><li>Garg, Vijay K, Wireless Communication Networking, Morgan Kaufman Publisher, San Fransisco, 2007 </li><li>Wheat, Hiser, Tucker, Neely and McCullogh, Designing A Wireless Network, Syngress Publishing, INC, Rockland,2001</li><li>Ilyas, Mohammad and Ahson Syed, Handbook of WLAN, Taylor Francis Group, Boca Raton, 2005<br></li></ol>', '2022-07-01 18:57:09', '2022-07-01 18:57:09'),
('96adaea2-cfaa-4a5b-84a3-08f70d113240', 'TIF-5345', 'Sistem Informasi Geografis', 5, 2019, 3, 3, 2, 1, '<p>Mahasiswa memiliki kemampuan memahami konsep SIG, menganalisis data spasial dan merepresentasikan data spasial serta\r\nmampu mengembangkan Web SIG dalam studi kasus tertentu.<br></p>', '<p><b>Teori :\r\n</b></p><ol><li>Konsep Dasar SIG </li><li>Isu-isu pada SIG </li><li>Model Data Spasial</li><li>Teknik Pengambilan Data Spasial</li><li>Analisis Data Spasial</li><li>Basisdata dan Manajemen Basisdata SIG</li><li>Pengenalan Google Maps API</li><li>Pengenalan Tools SIG</li></ol><p><span style=\"font-size: 1rem;\"><b>Praktikum :&nbsp;</b></span></p><ol><li><span style=\"font-size: 1rem;\"> Pembuatan Peta Dasar dan Layer Menggunakan Tools SIG</span></li><li><span style=\"font-size: 1rem;\">Web GIS Menggunakan Google Maps API</span><br></li></ol>', '<ol><li>Adil, Ahmad. (2017). Sistem Informasi Geografis. Yogyakarta: Penerbit Andi.</li><li>Budiyanto, Eko. (2016). Sistem Informasi Geografis dengan Quantum GIS. Yogyakarta: Penerbit Andi.</li><li>Indarto. (2013). Sistem Informasi Geografis. Yogyakarta: Graha Ilmu.</li><li>Irwansyah, Edy, 2013, Sistem Informasi Georafis : Prinsip dasar dan pengembangan.Digibook. Yogyakarta.</li><li>Karman, J., dkk. (2019) Sistem Informasi Geografis Berbasis Android. Yogyakarta: Penerbit Deepublish.</li><li>https://developers.google.com/maps/documentation<br></li></ol>', '2022-07-01 18:57:14', '2022-07-01 18:57:14'),
('96adaea9-8528-47c2-b5a9-e4a78fcefa09', 'TIF-5247', 'Mobile Programming 2', 5, 2019, 2, 2, 0, 2, '<p>Setelah mengikuti mata kuliah ini, Mahasiswa diharapkan dapat :</p><ol><li>Memahami dan mampu menggunakan teknologi hybrid dalam pengembangan aplikasi berbasis android</li><li>Memahami dan mampu menggunakan framework flutter dalam mengembangkan aplikasi berbasis android<br></li></ol>', '<p><b>Praktikum :\r\n</b></p><ol><li>Dart Object Oriented</li><li>Basic Widgets</li><li>Material Widgets</li><li>Material and Cupertino Design</li><li>Design Principle</li><li>Networking Restfull API</li><li>Serializers</li><li>Local Storage</li><li>Keychain dan Keystore </li><li>Database </li><li>Architecture MVVM</li><li>Package Manager</li><li>Publishing<br></li></ol>', '<ol><li><a href=\"https://developer.android.com/docs?hl=id\" target=\"_blank\">developer.android.com</a></li><li><a href=\"https://material.io/components\" target=\"_blank\">material.io</a></li></ol>', '2022-07-01 18:57:18', '2022-07-01 18:57:18');
INSERT INTO `mata_kuliah` (`id`, `kode`, `nama`, `semester`, `kurikulum`, `sks`, `jenis_mk`, `jam_teori`, `jam_praktikum`, `tiu`, `bahasan`, `referensi`, `created_at`, `updated_at`) VALUES
('96adaeb0-9ef6-4094-851c-7b644c76417e', 'TIF-5248', 'Etika Profesi', 5, 2019, 2, 1, 2, 0, '<p>Mahasiswa mengetahui etika-etika yang ada dalam dunia profesi ke informatikaan, serta mampu untuk membedakan dan\r\nmenerapkan etika tersebut dalam riwayat kekaryaan yaitu sebagai pekerja teknologi informas<br></p>', '<ol><li>Konsep Dasar Etika Profesi</li><li>Penggunaan Etika, Profesi dan Profesionalisme</li><li>Etika Komputer (Kode Etik, Sejarah dan Perkembangan)</li><li>Profesi di Bidang Teknologi Informasi</li><li>Modus Kejahatan dalam Teknologi Informasi (Cyber Crime)</li><li>Etika Komunikasi dalam Menggunakan Internet (Netiquette)</li><li>Cyber Ethics</li><li>Etika Bisnis dan E-Commerce</li><li>Peraturan dan Regulasi<br></li></ol>', '<ol><li>Fleddermann, Charles B,2006, Etika Enjiniring, edisi kedua, Penerbit Erlangga</li><li>Marin, Mike W dan Schinzinger, Roloand, 1997, Ethnics in Engineering, Mc Graw Hill, Singapore.</li><li>Artikel-artikel terkait standar profesi/kompetensi, IT audit dan forensik<br></li></ol>', '2022-07-01 18:57:23', '2022-07-01 18:57:23'),
('96adaeb6-f395-46ef-81ad-2cab81e28cc2', 'TIF-5349', 'Proyek 2', 5, 2019, 3, 2, 0, 3, '<p>Mahasiswa mampu merancang sistem informasi sesuai dengan studi kasus yang dipilih<br></p>', '<p><b>Praktikum :\r\n</b></p><ol><li>Pengajuan dan Verifikasi Judul Penelitian</li><li>Bimbingan Penyusunan Laporan Penelitian</li><li>Pendaftaran Seminar Penelitian</li><li>Pelaksanaan Seminar Penelitian dan Demo Produk Hasil Penelitian </li><li>Revisi Laporan dan Produk Hasil Penelitian Pasca Seminar</li><li>Pengumpulan Hasil Penelitian&nbsp;<br></li></ol>', '<ol><li>Buku Panduan Penulisan Proyek 2 Program Studi Teknik Informatika Politeknik Negeri Ketapang<br></li></ol>', '2022-07-01 18:57:27', '2022-07-01 18:57:27'),
('96adaefa-bc0e-4eee-81d1-c1d0162dbeb3', 'TIF-6650', 'Praktik Kerja Lapangan', 6, 2019, 6, 2, 0, 6, '<p>Mahasiswa mampu membandingkan serta mengaplikasikan ilmu yang didapat di bangku kuliah dengan kenyataan yang ada\r\ndilapangan&nbsp;<br></p>', '<ol><li>Pendaftaran Praktik Kerja Lapangan</li><li>Praktik Kerja Lapangan</li><li>Bimbingan Penyusunan Laporan Praktik Kerja Lapangan</li><li>Pendaftaran Seminar Praktik Kerja Lapangan</li><li>Pelaksanaan Seminar Praktik Kerja Lapangan</li><li>Revisi Laporan Praktik Kerja Lapangan</li><li>Pengumpulan Laporan Praktik Kerja Lapangan<br></li></ol>', '<ol><li>Buku Panduan Penulisan Praktik Kerja Lapangan Program Studi Teknik Informatika Politeknik Negeri Ketapang<br></li></ol>', '2022-07-01 18:58:11', '2022-07-01 18:58:11'),
('96adaefe-8ea5-40ee-9fa2-d5840adc0f8d', 'PNK-0612', 'Tugas Akhir', 6, 2019, 6, 2, 0, 6, '<p>Mahasiswa mampu membangun sebuah perangkat lunak yang dituangkan dalam bentuk tulisan ilmiah<br></p>', '<p>Integrasi pengetahuan dan keterampilan yang telah dipelajari untuk memecahkan masalah sesuai dengan bidang Teknik Informatika\r\nyang dituangkan dalam bentuk karya tulis ilmiah untuk diseminarkan dalam forum ujian sidang akhir studi ahli madya.\r\nTahapan Pelaksanaan Tugas Akhir</p><ol><li>Pendaftaran Judul Tugas Akhir </li><li>Verifikasi Judul Tugas Akhir</li><li>Pengajuan Pembimbing Tugas Akhir 1 dan 2</li><li>Bimbingan Penyusunan Laporan Tugas Akhir dan Produk Hasil Penelitian</li><li>Pendaftaran Sidang Tugas Akhir</li><li>Pelaksanaan Sidang Tugas Akhir</li><li>Revisi Laporan dan Produk Hasil Penelitian Tugas Akhir</li><li>Pengumpulan Dokumen Laporan dan Produk Hasil Penelitian Tugas Akhir</li><li>Pembuatan Jurnal Hasil penelitian Mahasiswa<br></li></ol>', '<ol><li>Buku Panduan Penulisan Tugas Akhir Program Studi Teknik Informatika Politeknik Negeri Ketapang </li><li>Buku Panduan Penulisan Tugas Akhir Versi Buku Program Studi Teknik Informatika Politeknik Negeri Ketapang</li><li>Format Penulisan Jurnal Tugas Akhir Program Studi Teknik Informatika Politeknik Negeri Ketapang<br></li></ol>', '2022-07-01 18:58:14', '2022-07-01 18:58:14'),
