rial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Memahami konsep dasar Teknologi Informasi</li><li>Memahami Sistem Komputer dan fungsinya</li><li>Memahami Konsep Dasar Arsitektur Sistem Komputer</li><li>Memahami Konsep Dasar Teori Bilangan</li><li>Memahami Konsep Dasar Sistem Komunikasi dan Teknologi Internet</li><li>Memahami Konsep Dasar Sistem Jaringan</li><li>Memahami Konsep Dasar Basisdata</li><li>Mengetahui Beberapa Bidang Aplikasi dari Teknologi</li><li>Mengetahui Perkembangan Teknologi Informasi Terkini</li></ol>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Simarmarta, Janner. 2006. Pengenalan Teknologi Komputer dan Informasi, Andi, Yogyakarta.</li><li>Kadir, Abdul, Triwahyudi, Terra CH. 2005. Pengenalan Teknologi Informasi, Andi, Yogyakarta.</li></ol>', '2022-07-01 18:59:01', '2022-07-01 18:59:01'),
