('96adafd0-1772-44d2-8f62-60a8a22d1448', 'IFK-2322', 'Pemrograman Berorientasi Objek', 2, 2022, 3, 3, 1, 2, '<p><span style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\">Kuliah ini mengajarkan konsep pemrograman berorientasi obyek disertai contoh penerapan konsep pemrograman berorientasi</span><br style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\">obyek pada bahasa pemrograman. Pada kuliah ini mahasiswa diharapkan dapat merancang dan mengimplementasikan</span><br style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\">permasalahan ke dalam konsep pemrograman berorientasi obyek dengan diberikan tugas-tugas pemrograman dan tugas proyek.</span><br></p>', '<p style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"font-weight: bolder;\">Teori :</span><br></p><ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>1. Konsep Pemrograman Berorientasi Objek</li><li>Pondasi Pemrograman Berorientasi Objek</li><li>Analsis dan Desain Berorientasi Objek</li><li>Class and Method</li><li>Instance Object</li><li>Abstraction, Inheritance</li><li>Encapsulation</li><li>Polymorphism</li><li>Data Collection</li><li>Class Relationship</li></ol><p style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"font-weight: bolder;\">Praktikum&nbsp;</span>:<br>Implementasi OOP dalam Bahasa Pemrograman</p>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Hadaya, KH., 2015, Java dektop dengan metode Pro-OOP, ANDI PUBLISHER, Andi</li><li>Timothy C. Lethbridge and Robert Laganière. Object-Oriented Software Engineering: Practical Software Development<br>using UML and Java Second Edition.</li></ol>', '2022-07-01 19:00:31', '2022-07-01 19:00:31'),
