('96adb0cd-96ec-4f21-b47a-6f589b9e0a57', 'IFK-4337', 'Sistem Pendukung Keputusan', 4, 2022, 3, 3, 1, 2, '<p><span style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\">Mahasiswa mengerti dan mampu menerapkan konsep pengambilan keputusan dalam organisasi memanfaatkan sistem berbasis</span><br style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\">komputer untuk mendukung pengambilan keputusan.</span><br></p>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Proses pengambilan keputusan (Proses pengambilan keputusan, jenis permasalahan dalam model keputusan, Tahapan<br>Pengambilan Keputusan, LKlasifikasi Pengambilan Keputusan, Klasifikasi Pengambilan Keputusan, Klasifikasi Model Data,<br>Klasifikasi Solusi,Multicriteria decision making) (MCDM), (Multi Objective Decision Making (MODM)</li><li>Sistem pendukung keputusan (Menjelaskan Tahapan Pengembangan SPK)</li><li>Metode Pembobotan</li><li>SAW</li><li>AHP</li><li>TOPSIS</li><li>VIKOR</li><li>ELECTRE</li><li>FUZZY</li></ol>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Dicky Nofriansyah, S.Kom.,M.Kom (Konsep Data Mining Vs Sistem Pendukung Keputusan)</li><li>Diana, S.Si.m M.Kom ( Metode dan Aplikasi Sistem Pendukung Keputusan)</li><li>Irfan Subakti, Sistem Pendukung Keputusan (Decision Support System), ITS, Surabaya, 2002.</li><li>Yayasan Kita Menulis (Sistem Pendukung Keputusan metode dan implementasi)</li></ol>', '2022-07-01 19:03:17', '2022-07-01 19:03:17');
INSERT INTO `mata_kuliah` (`id`, `kode`, `nama`, `semester`, `kurikulum`, `sks`, `jenis_mk`, `jam_teori`, `jam_praktikum`, `tiu`, `bahasan`, `referensi`, `created_at`, `updated_at`) VALUES
('96adb0d1-d85d-4bda-874b-0df45822f72f', 'IFK-4338', 'Kecerdasan Buatan', 4, 2022, 3, 3, 1, 2, '<div class=\"form-group row\" style=\"margin-right: -15px; margin-left: -15px; color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><div class=\"col-sm-9\" style=\"width: 566.273px; min-height: 1px; padding-right: 15px; padding-left: 15px; -webkit-box-flex: 0;\"><label class=\"form-label\" style=\"text-align: justify;\"><ol style=\"font-weight: normal;\"><li>Mahasiswa mengerti konsep dasar sistem cerdas: fuzzy logic, neural network dan algoritma genetika.</li><li>Mahasiswa mengerti dan mampu menerapkan sistem cerdas dalam aplikasi sederhana.</li></ol></label></div></div>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Pengantar Kecerdasan Buatan,</li><li>Sistem Pakar</li><li>Case Based Reasoning</li><li>Rule Based Reasoning</li><li>Jaringan Syaraf Tiruan</li><li>Logika Fuzzy</li><li>Algoritma Genetika</li></ol>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Sri Kusumadewi, 2004, Aplikasi Logika Fuzzy Untuk Pendukung Keputusan, Graha Ilmu, Yogyakarta.</li><li>Son Kuswadi, 2000, Kendali Cerdas, DiktatKuliah Politeknik ITS, Surabaya</li><li>Arief Hermawan,2006, Jaringan Syaraf Tiruan Teori dan Aplikasi, Penerbit Andi, Yogyakarta.</li><li>Suyanto, 2005, Algoritma Genetika dalam Matlab, Penerbit Andi, Yogyakarta.</li><li>Sri Kusumadewi, 2002, Analisis dan Desain Sistem Fuzzy Menggunakan Toolbox Matlab, Graha Ilmu, Yogyakarta.</li></ol>', '2022-07-01 19:03:20', '2022-07-01 19:03:20'),
('96adb0d5-dc37-47d6-8232-45ea9a80a436', 'IFK-4340', 'Data Mining', 4, 2022, 3, 3, 1, 2, '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Mahasiswa mampu menjelaskan pengertian tentang konsep-konsep fundamental yang berkaitan dengan penggunaan dan<br>implementasi data mining</li><li>Mahasisswa mampu mendesain dan mengimplementasikan data mining sesuai dengan kebutuhan pengguna dimana data<br>mining merupakan bagian yang tidak terpisahkan dari sebuah system.</li></ol>', '<p style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"font-weight: bolder;\">Teori :</span></p><ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Pengenalan Data Mining</li><li>Pengenalan Data Warehouse</li><li>Pengenalan Algoritma Data Mining</li><li>Pengenalan Teknik Data Mining (Asosiasi, Klasifikasi, dan Klastering)</li><li>Knowledge Discovery in Database (KDD)</li><li>Pengenalan Software Data Mining</li></ol><p style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><span style=\"font-weight: bolder;\">Praktikum :&nbsp;<br></span></p><ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Data Cleansing</li><li>Data Processing</li></ol>', '<div class=\"form-group row\" style=\"margin-right: -15px; margin-left: -15px; color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><div class=\"col-sm-9\" style=\"width: 566.273px; min-height: 1px; padding-right: 15px; padding-left: 15px; -webkit-box-flex: 0;\"><label class=\"form-label\" style=\"text-align: justify;\"><ol style=\"font-weight: normal;\"><li>Efori Buulolo, S.Kom., M.Kom (Data Mining untuk PT)</li><li>Kusrini, Emha Taufiq Luthfi (Algoritma Data Mining)</li><li>Miftahun Huda, M.Kom (Algoritma Data Mining Anlisis data dengan Komputer</li></ol></label></div></div>', '2022-07-01 19:03:23', '2022-07-01 19:03:23'),
('96adb0da-c875-4425-926b-6c9e7d16a56e', 'IFK-4342', 'Teknologi Komunikasi', 4, 2022, 3, 3, 1, 2, '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Memahami prinsip kerja sistem komunikasi nirkabel.</li><li>Memahami karakteristik komunikasi nirkabel dan Transmisi Komunikasi Nirkabel pek propagasi, redaman dan sistem modulasi<br>pada komunikasi nirkabel.</li><li>Memahami jaringan pada sistem komunikasi nirkabel.</li><li>Memanfaatkan teknologi-teknologi pada sistem komunikasi nirkabel</li></ol>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Pengenalan Sistem Komunikasi Nirkabel</li><li>Transmisi Komunikasi Nirkabel : Konsep Frekuensi, Sinyal, Antena dan Propagasi, Redaman, Konsep Multiplexing, Modulasi<br>Digital.</li><li>Sistem komunikasi bergerak : GSM,UMTS &amp; CDMA</li><li>Jaringan IEEE 802.11 dan Implementasinya : Jaringan Wireless LAN, Wireless Security</li><li>Desain Jaringan Wireless LAN : Point-to-Point dan Point-to-Multipoint Wireless Network</li><li>Studi kasus perencanaan jaringan nirkabel.</li></ol>', '<ol style=\"color: rgb(128, 128, 128); font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px; text-align: justify;\"><li>Garg, Vijay K, Wireless Communication Networking, Morgan Kaufman Publisher, San Fransisco, 2007</li><li>Wheat, Hiser, Tucker, Neely and McCullogh, Designing A Wireless Network, Syngress Publishing, INC, Rockland,2001</li><li>Ilyas, Mohammad and Ahson Syed, Handbook of WLAN, Taylor Francis Group, Boca Raton, 2005</li></ol>', '2022-07-01 19:03:26', '2022-07-01 19:03:26'),
('96adb1a0-98b3-41e7-96f6-b00f8dfb9569', 'IFK-4339', 'Sistem Informasi Geografis', 4, 2022, 3, 3, 1, 2, '<p><span style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\">Mahasiswa memiliki kemampuan memahami konsep SIG, menganalisis data spasial dan merepresentasikan data spasial serta</span><br style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><span style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\">mampu mengembangkan Web SIG dalam studi kasus tertentu.</span><br></p>', '<p><br></p><p style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><span style=\"font-weight: bolder;\">Teori :<br></span></p><ol style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><li style=\"list-style: none; margin: 0px; padding: 0px;\">Konsep Dasar SIG</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Isu-isu pada SIG</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Model Data Spasial</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Teknik Pengambilan Data Spasial</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Analisis Data Spasial</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Basisdata dan Manajemen Basisdata SIG</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Pengenalan Google Maps API</li><li style=\"list-style: none; margin: 0px; padding: 0px;\">Pengenalan Tools SIG</li></ol><p style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><span style=\"font-size: 1rem;\"><span style=\"font-weight: bolder;\">Praktikum :&nbsp;</span></span></p><ol style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 17.6px;\"><li style=\"list-style: none; margin: 0px; padding: 0px;\"><span style=\"font-size: 1rem;\">Pembuatan Peta Dasar dan Layer Menggunakan Tools SIG</span></li><li style=\"list-style: none; margin: 0px; padding: 0px;\"><span style=\"font-size: 1rem;\">Web GIS Menggunakan Google Maps API</span></li></ol>', '<ol style=\"color: rgb(128, 128, 128); text-align: justify; font-family: Muli, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple