INSERT INTO `visimisi` (`id`, `label`, `isi`, `created_at`, `updated_at`) VALUES
('96b5b87b-48a7-4b5c-81e8-2c0dcda9898a', 'Visi Program Studi dan Kompetensi Utama', '<p class=\"MsoNormal\">Menjadi program studi unggul dan terdepan dalam menghasilkan\r\nsumber daya manusia bidang keahlian teknologi informasi untuk dunia industri\r\nkhususnya di Kalimantan Barat pada tahun 2025 dan nasional pada tahun 2030<o:p></o:p></p>', '2022-07-06 02:01:12', '2022-07-05 19:01:12'),
('96b5ba04-9fe1-4ad7-b661-710f08a6cab8', 'Misi Program Studi dan Kompetensi Utama', '<ol><li>Menyiapkan lulusan di bidang Teknik Informatika yang mampu\r\nmemasuki tantangan dan peluang kerja.</li><li>Melaksanakan pendidikan dan pengajaran di bidang Teknik\r\nInformatika yang berorientasi pada perkembangan ilmu pengetahuan</li><li>Mengembangkan ilmu pengetahuan dan teknologi bidang Teknik\r\nInformatika dengan berkolaborasi dengan asosiasi profesi dan penguna lulusan\r\nprogram studi Teknik Informatika</li><li>Menyelenggarakan dan mengembangkan penelitian dibidang\r\nteknik informatika yang berkontribusi bagi perkembangan ilmu pengetahuan dan\r\nteknologi</li><li>Melaksanakan pengambdian kepada masyarakat dibidang teknik\r\ninformatika yang bermanfaat untuk masyarakat luas</li><li>Membangun kerjasama dengan pihak instansi pemerintah dan\r\nindustri</li></ol><p class=\"MsoNormal\"><o:p></o:p></p>', '2022-07-05 18:55:41', '2022-07-05 18:55:41'),
('96b5ba48-450d-443c-8bf9-16afca3e2b25', 'Tujuan Program Studi', '<p class=\"MsoNormal\">Tujuan Program Studi Teknik Informatika Politeknik Negeri\r\nKetapang Adalah Menghasilkan Sumber Daya Manusia Yang Handal Dibidang\r\nInformatika Dan Relevan Dengan Kebutuhan Industri</p>', '2022-07-05 18:56:25', '2022-07-05 18:56:25');
